    da: "Loading...",
    nl: 'SERVERFOUT. Het lijkt erop dat uw onderzoek niet beschikbaar is (404) op de Pavlovia-server. Er zijn verschillende manieren waarop dit kan gebeuren. U kunt het probleem als volgt oplossen:\n1. Het kan een kortstondig probleem zijn geweest, dat nu verdwenen is. Misschien was Pavlovia traag met het beschikbaar stellen van het onderzoek, of was er een tijdelijke storing vanwege het grote serververkeer. Probeer de onderzoekspagina te vernieuwen door op de vernieuwingsknop ↻ in de adresbalk van uw browser te klikken. Je kunt het meer dan één keer proberen. Als deze beschikbaar komt, zal uw onderzoek normaal verlopen.\n2. Als dat niet lukt, klikt u op de EasyEyes-compilerpagina op de knop "Ga naar Pavlovia" (rechtsonder op de pagina) om het Pavlovia-dashboard voor uw onderzoek te openen.\n3. Zorg ervoor dat uw onderzoek in het Pavlovia-dashboard in de “RUNNING”-modus staat. Als het INACTIEF is, druk dan op de knop RUNNING. Binnen twee seconden schakelt uw onderzoek over naar de RUNNING-modus en kan nu normaal worden uitgevoerd. Ga terug naar de EasyEyes-compilerpagina en klik op UITVOEREN, of gebruik de onderzoeks-URL.\n4. Als uw niet-beschikbare onderzoek al in de UITVOER-modus staat, betekent dit doorgaans dat uw onderzoek geen krediet/licentie heeft om te betalen voor online testen. Er zijn drie manieren om verder te gaan.\n5. GRATIS PILOTTEN VANAF HET PAVLOVIA DASHBOARD. Als je wilt, kun je op de knop PILOTING in het Pavlovia-dashboard klikken om je studie in de PILOTING-modus te zetten. Voer uw onderzoek uit door op de PILOT-knop te drukken (in het Pavlovia-dashboard). Dat is gratis, maar uw studie-URL blijft niet beschikbaar.\n6. ONLINE RENNEN MET KREDIET. Om online te werken, kunt u in hetzelfde dashboard credits kopen bij Pavlovia en een deel ervan aan dit onderzoek toewijzen. Hierdoor kan dit onderzoek online worden uitgevoerd.\n7. ONLINE UITVOEREN MET LICENTIE. EasyEyes heeft een sitelicentie voor Pavlovia. Schrijf naar denis.pelli@nyu.edu en vraag om uw e-mailadres op te nemen in de EasyEyes Pavlovia-sitelicentie. (Of, als uw instelling een Pavlovia-sitelicentie heeft, kunt u deze in plaats daarvan gebruiken.) Geef uw e-mailadres op in het Pavlovia-dashboard om aan te tonen dat u over een licentie beschikt, wat Pavlovia in toekomstige sessies zal onthouden. Hierdoor kunnen al je studies online plaatsvinden.',
    "en-UK":
      "SERVER ERROR. Your study seems to be unavailable (404) on the Pavlovia server. There are several ways that this can happen. Here's how to fix the problem:\n1. It might have been a momentary issue, now gone. Perhaps Pavlovia was slow in making the study available, or there was a temporary outage due to high server traffic. Try refreshing the study page by clicking the refresh button ↻ in your browser’s address bar. You can try more than once. If it becomes available, your study will run normally.\n2. Failing that, on the EasyEyes compiler page, click the “Go to Pavlovia” button (lower right side of page) to open the Pavlovia dashboard for your study.\n3. In the Pavlovia dashboard, make sure your study is in “RUNNING” mode. If it’s INACTIVE, then press the RUNNING button. In two seconds your study will switch to the RUNNING mode, and can now run normally. Go back to the EasyEyes compiler page and click RUN, or use the study URL.\n4. If your unavailable study is already in RUNNING mode, that typically indicates that your study lacks credit/licence to pay for online testing. There are three ways to proceed.\n5. PILOT FOR FREE FROM THE PAVLOVIA DASHBOARD. If you like, you can click the PILOTING button in the Pavlovia dashboard to put your study into PILOTING mode. Run your study by pressing the PILOT button (in the Pavlovia dashboard). That’s free, but your study URL remains unavailable.\n6. RUN ONLINE WITH CREDIT. To run online, in the same dashboard you can buy credits from Pavlovia and assign some to this study. That will allow this study to run online.\n7. RUN ONLINE WITH LICENCE. EasyEyes has a site licence for Pavlovia. Write to denis.pelli@nyu.edu and ask to have your email included in the EasyEyes Pavlovia site licence. (Or, if your institution has a Pavlovia site licence, you can use it instead.) Provide your email address to the Pavlovia dashboard to show that you’re licensed, which Pavlovia will remember in future sessions. This allows all your studies to run online.",
    fi: "Loading...",
    fr: "ERREUR DU SERVEUR. Votre étude semble être indisponible (404) sur le serveur Pavlovia. Il y a plusieurs raisons pour lesquelles cela peut se produire. Voici comment résoudre le problème :\n1. Cela pourrait être un problème momentané, maintenant résolu. Peut-être que Pavlovia a été lent à rendre l'étude disponible, ou il y a eu une panne temporaire due à un trafic élevé sur le serveur. Essayez de rafraîchir la page de l'étude en cliquant sur le bouton de rafraîchissement ↻ dans la barre d'adresse de votre navigateur. Vous pouvez essayer plus d'une fois. Si elle devient disponible, votre étude fonctionnera normalement.\n2. Sinon, sur la page du compilateur EasyEyes, cliquez sur le bouton « Aller à Pavlovia » (en bas à droite de la page) pour ouvrir le tableau de bord Pavlovia pour votre étude.\n3. Dans le tableau de bord Pavlovia, assurez-vous que votre étude est en mode « EN COURS ». Si elle est INACTIVE, appuyez sur le bouton EN COURS. En deux secondes, votre étude passera en mode EN COURS et pourra maintenant fonctionner normalement. Retournez à la page du compilateur EasyEyes et cliquez sur RUN, ou utilisez l'URL de l'étude.\n4. Si votre étude indisponible est déjà en mode EN COURS, cela indique généralement que votre étude manque de crédit/licence pour payer les tests en ligne. Il y a trois façons de procéder.\n5. TESTER GRATUITEMENT DEPUIS LE TABLEAU DE BORD PAVLOVIA. Si vous le souhaitez, vous pouvez cliquer sur le bouton TEST en mode TEST dans le tableau de bord Pavlovia pour mettre votre étude en mode TEST. Exécutez votre étude en appuyant sur le bouton TEST (dans le tableau de bord Pavlovia). C'est gratuit, mais l'URL de votre étude reste indisponible.\n6. EXÉCUTER EN LIGNE AVEC CRÉDIT. Pour exécuter en ligne, dans le même tableau de bord, vous pouvez acheter des crédits auprès de Pavlovia et en attribuer à cette étude. Cela permettra à cette étude de fonctionner en ligne.\n7. EXÉCUTER EN LIGNE AVEC LICENCE. EasyEyes dispose d'une licence de site pour Pavlovia. Écrivez à denis.pelli@nyu.edu et demandez à ce que votre email soit inclus dans la licence de site EasyEyes Pavlovia. (Ou, si votre institution dispose d'une licence de site Pavlovia, vous pouvez l'utiliser à la place.) Fournissez votre adresse email au tableau de bord Pavlovia pour montrer que vous êtes licencié, ce que Pavlovia se souviendra lors des sessions futures. Cela permet à toutes vos études de fonctionner en ligne.",
