    hi: "Loading...",
    hu: "SZERVERHIBA. Úgy tűnik, hogy a tanulmánya nem érhető el (404) a Pavlovia szerveren. Ez többféleképpen is megtörténhet. A probléma megoldásának módja:\n1. Lehet, hogy ez egy pillanatnyi probléma volt, mára megszűnt. Lehet, hogy Pavlovia lassan tette elérhetővé a tanulmányt, vagy átmeneti kiesés volt a magas szerverforgalom miatt. Próbálja meg frissíteni a tanulmányi oldalt a böngésző címsorában található frissítés gombra ↻ kattintva. Többször is próbálkozhatsz. Ha elérhetővé válik, a tanulmány a szokásos módon fog futni.\n2. Ennek hiányában az EasyEyes fordító oldalán kattintson a „Go to Pavlovia” gombra (az oldal jobb alsó sarkában) a Pavlovia irányítópult megnyitásához a tanulmányhoz.\n3. A Pavlovia műszerfalon győződjön meg arról, hogy a dolgozószoba „RUNNING” módban van. Ha INAKTÍV, akkor nyomja meg a FUTÁS gombot. Két másodpercen belül a tanulmánya FUTÁS módba kapcsol, és a szokásos módon futhat. Menjen vissza az EasyEyes fordítóoldalára, és kattintson a FUTATÁS gombra, vagy használja a tanulmány URL-címét.\n4. Ha az Ön nem elérhető tanulmánya már FUTTATÁS módban van, ez általában azt jelzi, hogy a tanulmányának nincs kreditje/engedélye az online tesztelés kifizetéséhez. Három módja van a folytatásnak.\n5. INGYENES PILÓTA A PAVLOVIA IRÁNYÍTÓPULTRÓL. Ha tetszik, kattintson a PILOTÁZÁS gombra a Pavlovia műszerfalon, hogy a dolgozószobáját PILOTÁZÁS módba helyezze. Futtassa le tanulmányát a PILOT gomb megnyomásával (a Pavlovia műszerfalon). Ez ingyenes, de a tanulmányi URL továbbra sem érhető el.\n6. FUTÁS ONLINE HITELVEL. Az online futtatáshoz ugyanazon az irányítópulton vásárolhat krediteket a Pavloviától, és néhányat hozzárendelhet ehhez a tanulmányhoz. Ez lehetővé teszi a tanulmány online futtatását.\n7. ONLINE FUTÁS ENGEDÉLYVEL. Az EasyEyes rendelkezik Pavlovia webhelylicencével. Írjon a denis.pelli@nyu.edu címre, és kérje, hogy az e-mail címe szerepeljen az EasyEyes Pavlovia webhely licencében. (Vagy, ha az intézménye rendelkezik Pavlovia webhely licenccel, használhatja helyette.) Adja meg e-mail címét a Pavlovia irányítópultján, hogy igazolja, hogy rendelkezik engedéllyel, amelyre a Pavlovia emlékezni fog a következő üléseken. Ez lehetővé teszi, hogy minden tanulmánya online futhasson.",
    is: "Loading...",
    id: "Loading...",
    it: "ERRORE DEL SERVER. Il tuo studio sembra non essere disponibile (404) sul server Pavlovia. Ci sono diversi modi in cui questo può accadere. Ecco come risolvere il problema:\n1. Potrebbe essere stato un problema momentaneo, ora risolto. Forse Pavlovia era lento nel rendere disponibile lo studio, o c'è stata un'interruzione temporanea a causa dell'elevato traffico del server. Prova ad aggiornare la pagina dello studio cliccando il pulsante di aggiornamento ↻ nella barra degli indirizzi del tuo browser. Puoi provare più di una volta. Se diventa disponibile, il tuo studio funzionerà normalmente.\n2. In caso contrario, nella pagina del compilatore EasyEyes, clicca sul pulsante \"Vai a Pavlovia\" (in basso a destra della pagina) per aprire il dashboard di Pavlovia per il tuo studio.\n3. Nel dashboard di Pavlovia, assicurati che il tuo studio sia in modalità \"IN ESECUZIONE\". Se è INATTIVO, premi il pulsante IN ESECUZIONE. In due secondi il tuo studio passerà alla modalità IN ESECUZIONE e potrà ora funzionare normalmente. Torna alla pagina del compilatore EasyEyes e clicca su ESEGUI, o usa l'URL dello studio.\n4. Se il tuo studio non disponibile è già in modalità IN ESECUZIONE, ciò indica tipicamente che il tuo studio manca di crediti/licenza per pagare i test online. Ci sono tre modi per procedere.\n5. PILOTA GRATUITAMENTE DAL DASHBOARD DI PAVLOVIA. Se vuoi, puoi cliccare sul pulsante PILOTAGGIO nel dashboard di Pavlovia per mettere il tuo studio in modalità PILOTAGGIO. Esegui il tuo studio premendo il pulsante PILOTA (nel dashboard di Pavlovia). È gratuito, ma l'URL del tuo studio rimane non disponibile.\n6. ESEGUI ONLINE CON CREDITO. Per eseguire online, nello stesso dashboard puoi acquistare crediti da Pavlovia e assegnarne alcuni a questo studio. Ciò permetterà a questo studio di essere eseguito online.\n7. ESEGUI ONLINE CON LICENZA. EasyEyes ha una licenza di sito per Pavlovia. Scrivi a denis.pelli@nyu.edu e chiedi di includere la tua email nella licenza di sito EasyEyes Pavlovia. (Oppure, se la tua istituzione ha una licenza di sito Pavlovia, puoi usarla al suo posto.) Fornisci il tuo indirizzo email al dashboard di Pavlovia per dimostrare che sei autorizzato, cosa che Pavlovia ricorderà nelle sessioni future. Questo permette a tutti i tuoi studi di essere eseguiti online.",
