    "en-UK":
      "DYMO LABEL PRINTER INSTALLATION GUIDE\nFollow these steps to help this study print labels on your DYMO LabelWriter 550.\n① Install DYMO Software\nDownload & Install the latest DYMO software for your OS from the DYMO support website:\nhttps://www.dymo.com/support?cfid=user-guide\nIn your browser, go to:\nDYMO.WebApi.Mac.Host:\nEnsure that DYMO.WebApi.Mac.Host is running.\n② Configure Your Browser\n▶ Chrome\nGo to:\nchrome://flags\nSearch for TLS in the search bar.\nFrom the TLS results, disable:\n⚬ TLS 1.3 Early Data\n⚬ TLS 1.3 post-quantum key agreement\n⚬ Use ML-KEM in TLS 1.3\n⚬ Omit TLS client certificates if credential mode disallows.\nClick RELAUNCH at the bottom.\n▶ Firefox\nGo to Settings → Search for Certificate.\nUncheck “Allow Firefox to automatically trust third-party root certificates...”\nRestart Firefox.\n▶ Safari\nGo to:\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nIf prompted, choose\n“Show Details” → “visit this website”\nto bypass the security warning.\n③ Print a Label\nEnsure that DYMO.WebApi.Mac.Host is running.\nPress the PRINT LABEL button on this page.\n\nPROBLEM: If you still can’t print, confirm that DYMO.WebApi.Mac.Host is running or consult official DYMO support.\nCAUTION: Re-enable any security settings after printing to maintain the highest protection on your browser.",
    fi: "Loading...",
    fr: "GUIDE D'INSTALLATION DE L'IMPRIMANTE D'ÉTIQUETTES DYMO\nSuivez ces étapes pour aider cette étude à imprimer des étiquettes sur votre DYMO LabelWriter 550.\n① Installer le logiciel DYMO\nTéléchargez et installez le dernier logiciel DYMO pour votre système d'exploitation depuis le site de support DYMO :\nhttps://www.dymo.com/support?cfid=user-guide\nDans votre navigateur, allez à :\nDYMO.WebApi.Mac.Host :\nAssurez-vous que DYMO.WebApi.Mac.Host est en cours d'exécution.\n② Configurer votre navigateur\n▶ Chrome\nAllez à :\nchrome://flags\nRecherchez TLS dans la barre de recherche.\nDans les résultats TLS, désactivez :\n⚬ TLS 1.3 Early Data\n⚬ TLS 1.3 post-quantum key agreement\n⚬ Utiliser ML-KEM dans TLS 1.3\n⚬ Omettre les certificats clients TLS si le mode d'identification l'interdit.\nCliquez sur RELAUNCH en bas.\n▶ Firefox\nAllez dans Paramètres → Recherchez Certificat.\nDécochez “Permettre à Firefox de faire automatiquement confiance aux certificats racine tiers...”\nRedémarrez Firefox.\n▶ Safari\nAllez à :\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nSi vous y êtes invité, choisissez\n“Afficher les détails” → “visiter ce site”\npour contourner l'avertissement de sécurité.\n③ Imprimer une étiquette\nAssurez-vous que DYMO.WebApi.Mac.Host est en cours d'exécution.\nAppuyez sur le bouton IMPRIMER L'ÉTIQUETTE sur cette page.\n\nPROBLÈME : Si vous ne pouvez toujours pas imprimer, confirmez que DYMO.WebApi.Mac.Host est en cours d'exécution ou consultez le support officiel DYMO.\nATTENTION : Réactivez tous les paramètres de sécurité après l'impression pour maintenir la plus haute protection sur votre navigateur.",
