    id: "PANDUAN PEMASANGAN PRINTER LABEL DYMO\nIkuti langkah-langkah berikut untuk membantu mempelajari label cetak pada DYMO LabelWriter 550 Anda.\n① Instal Perangkat Lunak DYMO\nUnduh & Instal perangkat lunak DYMO terbaru untuk OS Anda dari situs web dukungan DYMO:\nhttps://www.dymo.com/support?cfid=user-guide\nDi browser Anda, buka:\nDYMO.WebApi.Mac.Host:\nPastikan DYMO.WebApi.Mac.Host berjalan.\n② Konfigurasikan Peramban Anda\n▶ Krom\nKunjungi:\nchrome://bendera\nCari TLS di bilah pencarian.\nDari hasil TLS, nonaktifkan:\n⚬ TLS 1.3 Data Awal\n⚬ TLS 1.3 perjanjian kunci pasca-kuantum\n⚬ Gunakan ML-KEM di TLS 1.3\n⚬ Hilangkan sertifikat klien TLS jika mode kredensial tidak diizinkan.\nKlik LUNCURKAN KEMBALI di bagian bawah.\n▶ Firefox\nBuka Pengaturan → Cari Sertifikat.\nHapus centang “Izinkan Firefox memercayai sertifikat akar pihak ketiga secara otomatis…”\nMulai ulang Firefox.\n▶Safari\nKunjungi:\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nJika diminta, pilih\n“Tampilkan Detail” → “kunjungi situs web ini”\nuntuk melewati peringatan keamanan.\n③ Cetak Label\nPastikan DYMO.WebApi.Mac.Host berjalan.\nTekan tombol PRINT LABEL di halaman ini.\n\nMASALAH: Jika Anda masih tidak dapat mencetak, konfirmasikan bahwa DYMO.WebApi.Mac.Host sedang berjalan atau konsultasikan dengan dukungan resmi DYMO.\nPERHATIAN: Aktifkan kembali pengaturan keamanan apa pun setelah pencetakan untuk mempertahankan perlindungan tertinggi pada browser Anda.",
    it: "GUIDA ALL'INSTALLAZIONE DELLA STAMPANTE DYMO LABEL\nSegui questi passaggi per aiutare questo studio a stampare etichette sul tuo DYMO LabelWriter 550.\n① Installa il Software DYMO\nScarica e installa l'ultimo software DYMO per il tuo sistema operativo dal sito di supporto DYMO:\nhttps://www.dymo.com/support?cfid=user-guide\nNel tuo browser, vai a:\nDYMO.WebApi.Mac.Host:\nAssicurati che DYMO.WebApi.Mac.Host sia in esecuzione.\n② Configura il Tuo Browser\n▶ Chrome\nVai a:\nchrome://flags\nCerca TLS nella barra di ricerca.\nDai risultati TLS, disabilita:\n⚬ TLS 1.3 Early Data\n⚬ TLS 1.3 post-quantum key agreement\n⚬ Usa ML-KEM in TLS 1.3\n⚬ Ometti i certificati client TLS se la modalità di credenziali lo vieta.\nClicca su RILANCIA in fondo.\n▶ Firefox\nVai a Impostazioni → Cerca Certificato.\nDeseleziona “Consenti a Firefox di fidarsi automaticamente dei certificati root di terze parti...”\nRiavvia Firefox.\n▶ Safari\nVai a:\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nSe richiesto, scegli\n“Mostra Dettagli” → “visita questo sito”\nper bypassare l'avviso di sicurezza.\n③ Stampa un'Etichetta\nAssicurati che DYMO.WebApi.Mac.Host sia in esecuzione.\nPremi il pulsante STAMPA ETICHETTA in questa pagina.\n\nPROBLEMA: Se ancora non riesci a stampare, conferma che DYMO.WebApi.Mac.Host sia in esecuzione o consulta il supporto ufficiale DYMO.\nATTENZIONE: Riabilita tutte le impostazioni di sicurezza dopo la stampa per mantenere la massima protezione sul tuo browser.",
