    ar: 'هناك حاجة إلى معرف فريد لربط البيانات عبر الجلسات. هذا الكمبيوتر شارك سابقًا في جلسة على **ddd** مع معرف EasyEyes "**sss**". اضغط على موافق إذا كان هذا أنت. خلاف ذلك، إذا كان لديك ملف معرف EasyEyes، اضغط على زر اختيار الملف أدناه لفتحه. (يبدأ اسم الملف بـ "EasyEyes"، وينتهي بـ ".txt"، وعادة ما يكون في مجلد التنزيلات الخاص بك.) إذا لم يكن لديك ملف، ولكنك تعرف معرف EasyEyes الخاص بك، فاكتبه. خلاف ذلك، قم بإنشاء معرف خاص بك، والذي يمكن أن يكون أي سلسلة أبجدية رقمية (بالإضافة إلى الشرطة السفلية "_"، والشرطة "-"، والنقطة ".") لا تقل عن 5 أحرف. يمكن أن يكون اسمك، إذا أردت. سنقوم بتذكره لك على هذا الكمبيوتر، ولكن إذا ذهبت إلى كمبيوتر آخر، يرجى أخذ ملف معرف EasyEyes الخاص بك (أحدث ملف في مجلد التنزيلات الخاص بك)، أو على الأقل اكتب معرف EasyEyes الخاص بك. استخدمه في كل مرة لربط بياناتك من جلسة إلى أخرى.',
    hy: "Սեսիաների միջև տվյալները կապելու համար անհրաժեշտ է եզակի ID: Այս համակարգիչը նախկինում մասնակցել է **ddd**-ի նիստին EasyEyes ID-ով «**sss**»: Սեղմեք OK, եթե դա դուք եք: Հակառակ դեպքում, եթե ունեք EasyEyes ID ֆայլ, սեղմեք ներքևում գտնվող ֆայլի ընտրության կոճակը՝ այն բացելու համար: (Ֆայլի անունը սկսվում է «EasyEyes»-ով, ավարտվում է «.txt»-ով և սովորաբար գտնվում է ձեր «Ներբեռնումներ» թղթապանակում:) Եթե դուք ֆայլ չունեք, բայց գիտեք ձեր EasyEyes ID-ն, ապա մուտքագրեք այն: Հակառակ դեպքում, պարզապես կազմեք ձեր սեփական ID-ն, որը կարող է լինել ցանկացած այբբենական տող (գումարած «_» ընդգծում, գծիկ «-» և կետ «.») առնվազն 5 նիշ երկարությամբ: Դա կարող է լինել ձեր անունը, եթե ցանկանում եք: Մենք այն կհիշենք ձեզ համար այս համակարգչում, բայց եթե գնում եք մեկ այլ համակարգիչ, խնդրում ենք վերցնել ձեր EasyEyes ID ֆայլը (վերջին ֆայլը ձեր Ներբեռնումներ թղթապանակում), կամ գոնե գրեք ձեր EasyEyes ID-ն: Օգտագործեք այն ամեն անգամ՝ ձեր տվյալները սեսիաից սեսիա կապելու համար:",
    bg: 'Необходим е уникален идентификатор за свързване на данни между сесиите. Този компютър преди това е участвал в сесия на **ddd** с EasyEyes ID „**sss**“. Натиснете OK, ако това сте вие. В противен случай, ако имате EasyEyes ID файл, натиснете бутона за избор на файл по-долу, за да го отворите. (Името на файла започва с "EasyEyes", завършва с ".txt" и обикновено е в папката ви за изтегляния.) Ако нямате файл, но знаете вашето EasyEyes ID, въведете го. В противен случай просто създайте свой собствен идентификатор, който може да бъде произволен буквено-цифров низ (плюс долна черта "_", тире "-" и точка ".") с дължина най-малко 5 знака. Може да е вашето име, ако желаете. Ние ще го запомним вместо вас на този компютър, но ако отидете на друг компютър, моля, вземете вашия EasyEyes ID файл (най-новия файл във вашата папка за изтегляния) или поне запишете своя EasyEyes ID. Използвайте го всеки път, за да свържете данните си от сесия към сесия.',
    "zh-CN":
      "需要一个唯一的 ID 来链接会话之间的数据。此计算机之前曾使用 EasyEyes ID“**sss**”参与过 **ddd** 上的会话。如果是您，请按“确定”。否则，如果您有 EasyEyes ID 文件，请按下面的文件选择按钮将其打开。 （文件名以“EasyEyes”开头，以“.txt”结尾，通常位于您的“下载”文件夹中。）如果您没有文件，但知道您的 EasyEyes ID，请键入该文件。否则，只需编写您自己的 ID，它可以是任意字母数字字符串（加上下划线“_”、破折号“-”和句点“.”），长度至少为 5 个字符。如果你愿意的话，它可以是你的名字。我们会在这台计算机上为您记住它，但如果您转到另一台计算机，请取出您的 EasyEyes ID 文件（下载文件夹中的最新文件），或者至少记下您的 EasyEyes ID。每次都使用它来链接会话之间的数据。",
