    "en-UK":
      'A unique ID is needed to link data across sessions. This computer previously participated in a session on **ddd** with EasyEyes ID “**sss**”. Press OK if that\'s you. Otherwise, if you have an EasyEyes ID file, press the file selection button below to open it. (The filename begins with "EasyEyes", ends with ".txt", and is typically in your Downloads folder.) If you don\'t have a file, but know your EasyEyes ID, then type it. Otherwise, just make up your own ID, which can be any alphanumeric string (plus underscore "_", dash "-", and full stop ".") at least 5 characters long. It can be your name, if you like. We\'ll remember it for you on this computer, but if you go to another computer, please take your EasyEyes ID file (the most recent file in your Downloads folder), or at least write down your EasyEyes ID. Use it every time to link your data from session to session.',
    fi: "Loading...",
    fr: 'Un identifiant unique est nécessaire pour lier les données entre les sessions. Cet ordinateur a précédemment participé à une session sur **ddd** avec l\'ID EasyEyes « **sss** ». Appuyez sur OK si c\'est vous. Sinon, si vous avez un fichier d\'ID EasyEyes, appuyez sur le bouton de sélection de fichier ci-dessous pour l\'ouvrir. (Le nom de fichier commence par "EasyEyes", se termine par ".txt" et se trouve généralement dans votre dossier Téléchargements.) Si vous n\'avez pas de fichier, mais connaissez votre ID EasyEyes, tapez-le. Sinon, créez simplement votre propre ID, qui peut être n\'importe quelle chaîne alphanumérique (plus le soulignement "_", le tiret "-" et le point ".") d\'au moins 5 caractères. Cela peut être votre nom, si vous le souhaitez. Nous nous en souviendrons pour vous sur cet ordinateur, mais si vous allez sur un autre ordinateur, veuillez prendre votre fichier d\'ID EasyEyes (le fichier le plus récent dans votre dossier Téléchargements), ou au moins notez votre ID EasyEyes. Utilisez-le à chaque fois pour lier vos données de session en session.',
