    el: 'ΤΟ ΤΗΛΕΦΩΝΟ ΣΑΣ Android. Χρειαζόμαστε λεπτομέρειες που να προσδιορίζουν τη μάρκα και το μοντέλο του. Μεταβείτε στις Ρυθμίσεις > Σχετικά με το τηλέφωνο (πρώην "Σχετικά με τη συσκευή"). \nΓΙΑ SAMSUNG GALAXY: Αντιγράψτε τη μεγάλη επικεφαλίδα "Galaxy ..." στο όνομα μοντέλου παρακάτω και αντιγράψτε τον αριθμό μοντέλου στον αριθμό μοντέλου παρακάτω. \nΓΙΑ MOTO G: Το όνομα του μοντέλου και ο (αριθμός) συνδυάζονται σε μια γραμμή που ονομάζεται "Μοντέλο". Αντιγράψτε το όνομα (έξω από την παρένθεση) στο Όνομα μοντέλου παρακάτω. Αντιγράψτε τον αριθμό σε παρένθεση, ο οποίος μπορεί να περιλαμβάνει γράμματα και ψηφία, στον Αριθμό μοντέλου παρακάτω.\nΓΙΑ ΟΠΟΙΟΔΗΠΟΤΕ ΑΛΛΟ ΤΗΛΕΦΩΝΟ: Αντιγράψτε το "Όνομα προϊόντος" στο Όνομα μοντέλου παρακάτω. Αντιγράψτε το "Όνομα μοντέλου" στον αριθμό μοντέλου παρακάτω. ',
    he: "Loading...",
    hi: "Loading...",
    hu: 'AZ ÖN Android-TELEFONJA. A márkát és a modellt meghatározó részletekre van szükségünk. Nyissa meg a Beállítások > A telefonról menüpontot (korábban "Az eszközről"). \nSAMSUNG GALAXY: Másolja a nagy "Galaxy ..." fejlécet az alábbi modellnévhez, és másolja a modellszámot az alábbi modellszámhoz. \nMOTO G HASZNÁLATÁRA: A modell neve és (száma) egy „Model” nevű sorban található. Másolja a nevet (a zárójelen kívül) az alábbi modellnévbe. Másolja a zárójelben lévő számot, amely betűket és számjegyeket is tartalmazhat, az alábbi modellszámba.\nBÁRMELY MÁS TELEFON ESETÉN: Másolja a „Termék nevét” az alábbi modellnévbe. Másolja a „Modell neve” részt az alábbi modellszámhoz. ',
