    sw: "Loading...",
    sv: 'DIN Android-TELEFON. Vi behöver detaljer som anger dess märke och modell. Gå till Inställningar > Om telefonen (tidigare "Om enheten"). \nFÖR SAMSUNG GALAXY: Kopiera den stora rubriken "Galaxy ..." till modellnamnet nedan och kopiera modellnumret till modellnumret nedan. \nFÖR MOTO G: Modellnamnet och (numret) kombineras till en rad som kallas "Model". Kopiera namnet (utanför parenteser) till modellnamnet nedan. Kopiera numret inom parentes, som kan innehålla bokstäver och siffror, till modellnumret nedan.\nFÖR ALLA ANNAN TELEFON: Kopiera "Produktnamn" till modellnamn nedan. Kopiera "Model Name" till modellnumret nedan. ',
