    id: "Loading...",
    it: 'Il tuo iPhone. Abbiamo bisogno di due dettagli che specifichino il modello del tuo iPhone. Sul telefono, vai su Impostazioni > Generali > Info.\n\n1. NOME MODELLO. Se è in esecuzione iOS 12.2 o successivo, copia il Nome Modello nel campo sottostante. Se è in esecuzione una versione iOS precedente, vedi ULTIMA RISORSA qui sotto.\n\n2. NUMERO "A" NASCOSTO. Se stai utilizzando iOS 10 o successivo, toccando il Numero Modello verrà rivelato il numero "A" nascosto: una "A" seguita da quattro cifre, come A1234. Copia il numero A nel campo sottostante. \nSe è un iPhone 8 o successivo, con un vassoio SIM, rimuovi il vassoio SIM e cerca il numero A nello slot. Se non c\'è un vassoio SIM, cerca il numero A nel connettore Lightning o USB-C. Assicurati di essere in un luogo con luce intensa sopra di te. Il numero A si trova sul lato superiore — il lato con il display. Copia il numero A nel campo sottostante. \nSe l\'iPhone è più vecchio dell\'iPhone 8, il numero A è stampato sul retro come qualcosa tipo "Model A1234". Copia il numero A nel campo sottostante.\n\nULTIMA RISORSA. Se hai ChatGPT o equivalente, copia il Numero Modello dell\'iPhone, ad esempio MD298HB/A, dalla sua pagina Info e chiedi a ChatGPT il nome del modello e il numero A.',
    ja: "あなたのiPhone。 iPhone のモデルを指定する 2 つの詳細情報が必要です。電話機で、[設定] > [一般] > [バージョン情報] に移動します。 \n\n1. モデル名。 iOS 12.2 以降を実行している場合は、モデル名を下のフィールドにコピーします。古い iOS を実行している場合は、以下の「最後の手段」を参照してください。\n\n2. 隠された「A」番号。 iOS 10 以降を実行している場合は、モデル番号をタップすると、A1234 のように、「A」の後に 4 桁の数字が続く、隠れた「A」番号が表示されます。 A 番号を下のフィールドにコピーします。 \nSIM トレイのある iPhone 8 以降の場合は、SIM トレイを取り外し、スロットの A 番号を探します。 SIM トレイがない場合は、Lightning または USB-C コネクタの A 番号を探してください。頭上に明るい光が当たる場所にいるようにしてください。 A 番号は上側、つまりディスプレイのある側にあります。 A 番号を下のフィールドにコピーします。 \niPhone 8 より古い iPhone の場合、A 番号は「Model A1234」のように背面に印刷されています。 A 番号を下のフィールドにコピーします。 \n\n最後のリゾート。 ChapGPT または同等のものをお持ちの場合は、iPhone のモデル番号をコピーします。 MD298HB/A については、About ページから ChatGPT にモデル名と A 番号を問い合わせてください。",
    kn: "Loading...",
    ko: "Loading...",
    lt: "Loading...",
    ms: "Loading...",
    ml: 'നിങ്ങളുടെ iPhone. നിങ്ങളുടെ iPhone-ൻ്റെ മോഡൽ വ്യക്തമാക്കുന്ന രണ്ട് വിശദാംശങ്ങൾ ഞങ്ങൾക്ക് ആവശ്യമാണ്. ഫോണിൽ, ക്രമീകരണങ്ങൾ > പൊതുവായത് > കുറിച്ച് എന്നതിലേക്ക് പോകുക. \n\n1. മോഡലിൻ്റെ പേര്. ഇത് iOS 12.2 അല്ലെങ്കിൽ അതിന് ശേഷമുള്ള പതിപ്പിലാണ് പ്രവർത്തിക്കുന്നതെങ്കിൽ, മോഡലിൻ്റെ പേര് ചുവടെയുള്ള ഫീൽഡിലേക്ക് പകർത്തുക. ഇത് പഴയ iOS ആണ് പ്രവർത്തിപ്പിക്കുന്നതെങ്കിൽ, ചുവടെയുള്ള അവസാന റിസോർട്ട് കാണുക.\n\n2. മറച്ച "എ" നമ്പർ. നിങ്ങൾ iOS 10 അല്ലെങ്കിൽ അതിന് ശേഷമുള്ള പതിപ്പാണ് പ്രവർത്തിപ്പിക്കുന്നതെങ്കിൽ, മോഡൽ നമ്പർ ടാപ്പുചെയ്യുന്നത് മറഞ്ഞിരിക്കുന്ന "A" നമ്പർ വെളിപ്പെടുത്തും: ഒരു "A" എന്നതിന് ശേഷം A1234 പോലെയുള്ള നാല് അക്കങ്ങൾ. താഴെയുള്ള ഫീൽഡിലേക്ക് എ നമ്പർ പകർത്തുക. \nഇത് iPhone 8 അല്ലെങ്കിൽ അതിന് ശേഷമുള്ളതാണെങ്കിൽ, ഒരു സിം ട്രേ ഉപയോഗിച്ച്, സിം ട്രേ നീക്കം ചെയ്‌ത് സ്ലോട്ടിലെ A നമ്പർ നോക്കുക. സിം ട്രേ ഇല്ലെങ്കിൽ, മിന്നലിലോ USB-C കണക്ടറിലോ എ നമ്പർ നോക്കുക. നിങ്ങൾ തലക്ക് മുകളിൽ നല്ല വെളിച്ചമുള്ള സ്ഥലത്താണെന്ന് ഉറപ്പാക്കുക. A നമ്പർ മുകൾ വശത്താണ് - ഡിസ്പ്ലേ ഉള്ള വശം. താഴെയുള്ള ഫീൽഡിലേക്ക് എ നമ്പർ പകർത്തുക. \nഐഫോൺ ഐഫോൺ 8-നേക്കാൾ പഴയതാണെങ്കിൽ, എ നമ്പർ പുറകിൽ "മോഡൽ എ 1234" പോലെ പ്രിൻ്റ് ചെയ്തിരിക്കും. താഴെയുള്ള ഫീൽഡിലേക്ക് എ നമ്പർ പകർത്തുക. \n\nഅവസാന റിസോർട്ട്. നിങ്ങൾക്ക് ChapGPT അല്ലെങ്കിൽ തത്തുല്യമായത് ഉണ്ടെങ്കിൽ, iPhone-ൻ്റെ മോഡൽ നമ്പർ പകർത്തുക, ഉദാ. MD298HB/A, അതിൻ്റെ വിവര പേജിൽ നിന്ന് ചാറ്റ്ജിപിടിയോട് അതിൻ്റെ മോഡലിൻ്റെ പേരും എ നമ്പറും ചോദിക്കുക.',
    no: 'DIN iPhone. Vi trenger to detaljer som spesifiserer modellen til din iPhone. På telefonen går du til Innstillinger > Generelt > Om. \n\n1. MODELLNAVN. Hvis den kjører iOS 12.2 eller nyere, kopierer du modellnavnet til feltet nedenfor. Hvis den kjører en eldre iOS, se SISTE UTVEKSLING nedenfor.\n\n2. SKJULT "A"-NUMMER. Hvis du kjører iOS 10 eller nyere, kan du trykke på modellnummeret for å avsløre det skjulte "A"-nummeret: en "A" etterfulgt av fire sifre, som A1234. Kopier A-tallet inn i feltet nedenfor. \nHvis det er iPhone 8 eller nyere, med SIM-skuff, fjern SIM-skuffen og se etter A-nummeret i sporet. Hvis det ikke er noe SIM-skuff, se etter A-nummeret i Lightning- eller USB-C-kontakten. Sørg for at du er på et sted med sterkt lys over hodet. A-tallet er på oversiden - siden med skjermen. Kopier A-tallet inn i feltet nedenfor. \nHvis iPhone er eldre enn iPhone 8, er A-nummeret trykt på baksiden som noe sånt som "Model A1234". Kopier A-tallet inn i feltet nedenfor. \n\nSISTE UTSTYR. Hvis du har ChapGPT eller tilsvarende, kopier iPhones modellnummer, f.eks. MD298HB/A, fra Om-siden og spør ChatGPT om modellnavnet og A-nummeret.',
