    pt: 'SEU iPhone. Precisamos de dois detalhes especificando o modelo do seu iPhone. No telefone, vá em Ajustes > Geral > Sobre. \n\n1. NOME DO MODELO. Se estiver executando o iOS 12.2 ou posterior, copie o nome do modelo no campo abaixo. Se estiver executando um iOS mais antigo, consulte ÚLTIMO RECURSO abaixo.\n\n2. NÚMERO "A" OCULTO. Se você estiver executando o iOS 10 ou posterior, tocar no número do modelo revelará o número “A” oculto: um “A” seguido de quatro dígitos, como A1234. Copie o número A no campo abaixo. \nSe for iPhone 8 ou posterior, com bandeja do SIM, remova a bandeja do SIM e procure o número A no slot. Se não houver bandeja SIM, procure o número A no conector Lightning ou USB-C. Certifique-se de estar em um local com luz forte no teto. O número A está na parte superior – o lado do display. Copie o número A no campo abaixo. \nSe o iPhone for mais antigo que o iPhone 8, o número A será impresso na parte traseira como algo como “Modelo A1234”. Copie o número A no campo abaixo. \n\nÚLTIMO RECURSO. Se você tiver ChapGPT ou equivalente, copie o número do modelo do iPhone, por exemplo. MD298HB/A, na página Sobre e peça ao ChatGPT o nome do modelo e o número A.',
    ro: "Loading...",
    ru: "Loading...",
    sr: "Loading...",
