    ar: 'هاتف Palm الخاص بك. نحتاج إلى تفاصيل تحدد طرازه. انتقل إلى قائمة الإعدادات أو الخيارات، وانتقل إلى أسفل القائمة، وتحقق من "حول الهاتف"، "حول الجهاز" أو ما شابه. انسخ اسم الطراز والرقم إلى الحقول المقابلة أدناه.',
