    fi: "Loading...",
    fr: "VOTRE téléphone Palm. Nous avons besoin de détails spécifiant son modèle. Allez dans le menu Paramètres ou Options, faites défiler jusqu'en bas de la liste et vérifiez « À propos du téléphone », « À propos de l'appareil » ou similaire. Copiez le nom et le numéro du modèle dans les champs correspondants ci-dessous.",
