    sr: "Loading...",
    es: 'SELECCIONAR FRECUENCIA DE MUESTREO Y BITS POR MUESTRA (macOS)\n\nConfigure su dispositivo de entrada de audio (UMIK-2) utilizando las instrucciones a continuación para asegurarse de que coincida con la configuración requerida:\nFrecuencia de Muestreo: 111 Hz\nBits por Muestra: 222 bits\n        1.        Abra Configuración de Audio MIDI (en Aplicaciones > Utilidades).\n        2.        Seleccione su dispositivo (UMIK-2) en el panel izquierdo.\n        3.        Bajo "Formato", configure:\n        •        Frecuencia de Muestreo: 111 Hz\n        •        Profundidad de Bits: 222 bits\nUna vez configurado, regrese a esta página web y haga clic en CONTINUAR o presione RETURN.\n\n(La frecuencia de muestreo y la profundidad de bits requeridas están establecidas por los parámetros _calibrateSoundSamplingDesiredHz y _calibrateSoundSamplingDesiredBits en la hoja de cálculo del experimento.)',
    sw: "Loading...",
