    tl: "Loading...",
    tr: "ÖRNEKLEME ORANINI VE ÖRNEK BAŞINA BİT SEÇİN (macOS)\n\nLütfen ses giriş cihazınızı (UMIK-2) gerekli ayarlarla eşleştiğinden emin olmak için aşağıdaki talimatları kullanarak yapılandırın:\nÖrnekleme Hızı: 111 Hz\nÖrnek Başına Bit Sayısı: 222 bit\n        1. Ses MIDI Kurulumu'nu açın (Uygulamalar > Yardımcı Programlar'da).\n        2. Sol panelden cihazınızı (UMIK-2) seçin.\n        3. \"Biçim\" altında şunları ayarlayın:\n        • Örnekleme Hızı: 111 Hz\n        • Bit Derinliği: 222 bit\nYapılandırıldıktan sonra bu web sayfasına dönün ve DEVAM ET'e tıklayın veya GERİ DÖN'e basın.\n\n(Gerekli örnekleme hızı ve bit derinliği, çalışma elektronik tablosundaki _calibrateSoundSamplingDesiredHz ve _calibrateSoundSamplingDesiredBits parametreleri tarafından ayarlanır.)",
