    ja: "Loading...",
    kn: "Loading...",
    ko: "Loading...",
    lt: "Loading...",
    ms: "Loading...",
    ml: "Loading...",
    no: "Loading...",
    fa: "Loading...",
    pl: "⚠LISTA KONTROLNA\n1. Spójrz powyżej: Czy używamy właściwych głośników i mikrofonu?\n2. ⇧🔊 Głośność dźwięku komputera powinna być ustawiona na maksimum.\n3. Wszelkie słuchawki/douszne należy zdjąć i odłączyć.\n4. Należy zdjąć obudowę telefonu.\nW przypadku jakiegokolwiek problemu kliknij PONOWNIE URUCHOMIJ NAGRYWANIE, napraw go i KONTYNUUJ.",
    pt: "Loading...",
