    fr: "❌ Désolé, le téléphone répond lentement et pourrait être déconnecté. Vous pouvez :\n1. ATTENDRE plus longtemps. Cliquez sur le bouton ATTENDRE.\n2. RÉESSAYER en appuyant sur le bouton CALIBRER.\n3. METTRE À JOUR LE NAVIGATEUR DU TÉLÉPHONE. Les navigateurs compatibles incluent : Safari 12+ et Chrome 133+. Le navigateur BBB 111 de ce téléphone pourrait-il être trop ancien pour être compatible ? Dans ce cas, vous pourriez rendre ce téléphone compatible en mettant à jour son navigateur. Soit en passant à une version plus récente du système d'exploitation (et donc en mettant à jour tout navigateur intégré), soit en installant un nouveau navigateur, par exemple Chrome, et en le définissant comme navigateur par défaut. Une fois le navigateur du téléphone mis à jour, appuyez sur le bouton CALIBRER.\n4. ESSAYER UN AUTRE TÉLÉPHONE. Appuyez sur le bouton CALIBRER.\n5. TERMINER la session en appuyant sur le bouton QUITTER.",
