    hi: "Loading...",
    hu: "Loading...",
    is: "Loading...",
    id: "❌ Maaf, ponsel lambat merespons, dan mungkin terputus. Anda dapat:\n1. TUNGGU lebih lama. Klik tombol TUNGGU.\n2. COBA LAGI dengan menekan tombol KALIBRASI.\n3. UPGRADE BROWSER PONSEL. Browser ponsel yang kompatibel meliputi: Safari 12+ dan Chrome 133+. Mungkinkah browser BBB 111 ponsel ini terlalu tua untuk kompatibilitasnya? Dalam hal ini, Anda dapat membuat ponsel ini kompatibel dengan memperbarui browsernya. Tingkatkan ke versi OS yang lebih baru (dan dengan demikian tingkatkan browser bawaan apa pun), atau instal browser baru, misalnya. Chrome, dan menjadikannya browser default. Setelah browser ponsel ditingkatkan, tekan tombol KALIBRASI.\n4. COBA TELEPON LAIN. Tekan tombol KALIBRASI.\n5. AKHIR sesi dengan menekan tombol EXIT.",
    it: "❌ Mi dispiace, il telefono risponde lentamente e potrebbe essere disconnesso. Puoi:\n1. ASPETTARE più a lungo. Clicca sul pulsante ASPETTA.\n2. RIPROVARE premendo il pulsante CALIBRA.\n3. AGGIORNARE IL BROWSER DEL TELEFONO. I browser compatibili includono: Safari 12+ e Chrome 133+. Potrebbe essere che il browser BBB 111 di questo telefono sia troppo vecchio per essere compatibile? In tal caso, potresti rendere questo telefono compatibile aggiornando il suo browser. Puoi aggiornare a una versione più recente del sistema operativo (e quindi aggiornare qualsiasi browser integrato) o installare un nuovo browser, ad esempio Chrome, e impostarlo come browser predefinito. Una volta aggiornato il browser del telefono, premi il pulsante CALIBRA.\n4. PROVARE UN ALTRO TELEFONO. Premi il pulsante CALIBRA.\n5. TERMINARE la sessione premendo il pulsante ESCI.",
