    fi: "Loading...",
    fr: "[Si vous ne recevez pas la fenêtre contextuelle \"Autoriser ...\", et que l'ordinateur et le smartphone semblent bloqués, avec le code QR toujours affiché, veuillez actualiser leur communication. Essayez d'abord d'actualiser le navigateur du téléphone (tapez l'adresse ; appuyez sur aller). Si cela ne fonctionne pas, quittez le navigateur du téléphone (ou redémarrez votre téléphone), et utilisez l'appareil photo de votre téléphone pour vous reconnecter au code QR.]",
    de: "[Wenn das Popup „Zulassen ...“ nicht angezeigt wird und der Computer und das Smartphone scheinbar hängen bleiben und der QR-Code weiterhin angezeigt wird, aktualisieren Sie bitte ihre Kommunikation. Versuchen Sie zunächst, den Browser des Telefons zu aktualisieren (tippen Sie auf „Adresse“ und dann auf „Los“). Wenn das nicht funktioniert, beenden Sie den Browser des Telefons (oder starten Sie Ihr Telefon neu) und stellen Sie mit der Kamera Ihres Telefons erneut eine Verbindung zum QR-Code her.]",
    el: '[Εάν δεν εμφανιστεί το αναδυόμενο "Allow ..." και ο υπολογιστής και το smartphone φαίνεται να έχουν κολλήσει, με τον κωδικό QR να εξακολουθεί να εμφανίζεται, ανανεώστε την επικοινωνία τους. Πρώτα δοκιμάστε να ανανεώσετε το πρόγραμμα περιήγησης του τηλεφώνου (πατήστε διεύθυνση, πατήστε μετάβαση). Εάν αυτό δεν έχει αποτέλεσμα, κλείστε το πρόγραμμα περιήγησης του τηλεφώνου (ή επανεκκινήστε το τηλέφωνό σας) και χρησιμοποιήστε την κάμερα του τηλεφώνου σας για να συνδεθείτε ξανά στον κωδικό QR.]',
    he: "Loading...",
    hi: "Loading...",
    hu: '[Ha nem jelenik meg az "Engedélyezés..." felugró ablak, és úgy tűnik, hogy a számítógép és az okostelefon elakadt, és a QR-kód továbbra is látható, kérjük, frissítse a kommunikációt. Először próbálja meg frissíteni a telefon böngészőjét (koppintson a címre; koppintson a go gombra). Ha ez nem működik, lépjen ki a telefon böngészőjéből (vagy indítsa újra a telefont), és a telefon kamerájával csatlakozzon újra a QR-kódhoz.]',
    is: "Loading...",
    id: "Loading...",
    it: 'Se non ricevi il pop-up "Consenti ..." e il computer e lo smartphone sembrano bloccati, con il codice QR ancora visibile, aggiorna la loro comunicazione. Prima prova ad aggiornare il browser del telefono (tocca l\'indirizzo; tocca vai). Se non funziona, chiudi il browser del telefono (o riavvia il telefono) e usa la fotocamera del telefono per riconnetterti al codice QR.',
    ja: "Loading...",
    kn: "Loading...",
    ko: "Loading...",
    lt: "Loading...",
    ms: "Loading...",
    ml: "Loading...",
    no: "Loading...",
    fa: "Loading...",
    pl: "[Jeśli nie pojawi się wyskakujące okienko „Zezwalaj…”, a komputer i smartfon wydają się być zablokowane, a kod QR nadal jest wyświetlany, odśwież komunikację. Najpierw spróbuj odświeżyć przeglądarkę telefonu (stuknij adres; stuknij idź). Jeśli to nie zadziała, zamknij przeglądarkę telefonu (lub uruchom ponownie telefon) i użyj aparatu w telefonie, aby ponownie połączyć się z kodem QR.]",
    pt: "Loading...",
    ro: "[Dacă nu primiți fereastra pop-up „Permiteți...”, iar computerul și smartphone-ul par să fie blocate, cu codul QR încă afișat, vă rugăm să reîmprospătați comunicarea. Încercați mai întâi să reîmprospătați browserul telefonului (atingeți adresa; atingeți Go). Dacă acest lucru nu funcționează, închideți browserul telefonului (sau reporniți telefonul) și utilizați camera telefonului pentru a vă reconecta la codul QR.]",
    ru: "[Если всплывающее окно «Разрешить...» не появилось, а компьютер и смартфон зависли, а QR-код все еще отображается, обновите их общение. Сначала попробуйте обновить браузер телефона (нажмите «Адрес»; нажмите «Перейти»). Если это не помогло, закройте браузер телефона (или перезагрузите телефон) и используйте камеру телефона для повторного подключения к QR-коду.]",
    sr: "Loading...",
    es: 'Si no aparece la ventana emergente de "Permitir ..." y la computadora y el teléfono inteligente parecen estar atascados, con el código QR aún visible, por favor actualiza su comunicación. Primero intenta actualizar el navegador del teléfono (toca la dirección; toca ir). Si eso no funciona, cierra el navegador del teléfono (o reinicia tu teléfono) y usa la cámara de tu teléfono para reconectarte al código QR.',
    sw: '[Usipopata "Ruhusu ..." ibukizi, na kompyuta na simu mahiri zinaonekana kukwama, msimbo wa QR ukiendelea kuonekana, tafadhali onyesha upya mawasiliano yao. Kwanza jaribu kuonyesha upya kivinjari cha simu (gonga anwani; gonga nenda). Hilo lisipofanya kazi, acha kivinjari cha simu (au uwashe upya simu yako), na utumie kamera ya simu yako kuunganisha tena kwa msimbo wa QR.]',
    sv: '[Om du inte får popup-fönstret "Tillåt ..." och datorn och smartphonen verkar ha fastnat, medan QR-koden fortfarande visas, vänligen uppdatera deras kommunikation. Försök först att uppdatera telefonens webbläsare (tryck på adress; tryck på gå). Om det inte fungerar, avsluta telefonens webbläsare (eller starta om telefonen) och använd telefonens kamera för att återansluta till QR-koden.]',
