    es: "GUÍA DE INSTALACIÓN DE IMPRESORA DE ETIQUETAS DYMO\nSiga estos pasos para ayudar a este estudio a imprimir etiquetas en su DYMO LabelWriter 550.\n① Instalar el Software DYMO\nDescargue e instale el software DYMO más reciente para su sistema operativo desde el sitio web de soporte de DYMO:\nhttps://www.dymo.com/support?cfid=user-guide\nEn su navegador, vaya a:\nDYMO.WebApi.Mac.Host:\nAsegúrese de que DYMO.WebApi.Mac.Host esté en funcionamiento.\n② Configure su Navegador\n▶ Chrome\nVaya a:\nchrome://flags\nBusque TLS en la barra de búsqueda.\nDe los resultados de TLS, deshabilite:\n⚬ TLS 1.3 Early Data\n⚬ TLS 1.3 post-quantum key agreement\n⚬ Use ML-KEM in TLS 1.3\n⚬ Omitir certificados de cliente TLS si el modo de credenciales lo prohíbe.\nHaga clic en RELAUNCH en la parte inferior.\n▶ Firefox\nVaya a Configuración → Busque Certificado.\nDesmarque “Permitir que Firefox confíe automáticamente en certificados raíz de terceros...”\nReinicie Firefox.\n▶ Safari\nVaya a:\nhttps://127.0.0.1:41951/DYMO/DLS/Printing/StatusConnected\nSi se le solicita, elija\n“Mostrar detalles” → “visitar este sitio web”\npara omitir la advertencia de seguridad.\n③ Imprimir una Etiqueta\nAsegúrese de que DYMO.WebApi.Mac.Host esté en funcionamiento.\nPresione el botón IMPRIMIR ETIQUETA en esta página.\n\nPROBLEMA: Si aún no puede imprimir, confirme que DYMO.WebApi.Mac.Host esté en funcionamiento o consulte el soporte oficial de DYMO.\nPRECAUCIÓN: Vuelva a habilitar cualquier configuración de seguridad después de imprimir para mantener la máxima protección en su navegador.",
