    "zh-HK": "Loading...",
    hr: "Loading...",
    cs: "1. Tento počítač má 111 kamer. \n2. Tato studie sleduje pohled nebo pozorovací vzdálenost, pro kterou potřebuje kameru na horním okraji obrazovky, vyberte si prosím obrazovku s kamerou na horní hraně. \n3. Přetáhněte toto okno na kteroukoli obrazovku, kterou chcete pro tuto studii použít.\n4. Stačí být většinou na té obrazovce.\n5. Poté klikněte na POKRAČOVAT nebo stiskněte RETURN.",
    da: "Loading...",
    nl: "1. Deze computer heeft 111 camera('s). \n2. Dit onderzoek houdt de blik of kijkafstand bij, waarvoor een camera aan de bovenrand van het scherm nodig is. Kies daarom een ​​scherm met een camera aan de bovenrand. \n3. Sleep dit venster naar het scherm dat u voor dit onderzoek wilt gebruiken.\n4. Het is voldoende om grotendeels op dat scherm te zijn.\n5. Klik vervolgens op DOORGAAN of druk op RETURN.",
    "en-UK":
      "1. This computer has 111 camera(s).\n2. This study tracks gaze or viewing distance, for which it needs a camera at the top edge of the screen, so please choose a screen with a top-edge camera.\n3. Please drag this window to whichever screen you’d like to use for this study.\n4. It's enough to be mostly on that screen.\n5. Then click PROCEED or press RETURN.",
    fi: "Loading...",
