    de: "Loading...",
    el: "Loading...",
    he: "Loading...",
    hi: "Loading...",
    hu: "Loading...",
    is: "Loading...",
    id: "1. Komputer ini memiliki 111 kamera. \n2. Penelitian ini melacak pandangan atau jarak pandang, untuk itu diperlukan kamera di tepi atas layar, jadi silakan pilih layar dengan kamera tepi atas. \n3. Silakan seret jendela ini ke layar mana saja yang ingin Anda gunakan untuk penelitian ini.\n4. Cukup berada di layar itu saja.\n5. Lalu klik PROCEED atau tekan RETURN.",
    it: "1. Questo computer ha 111 fotocamera/e. \n2. Questo studio traccia lo sguardo o la distanza di visione, per cui necessita di una fotocamera sul bordo superiore dello schermo, quindi scegli uno schermo con una fotocamera sul bordo superiore. \n3. Trascina questa finestra sullo schermo che desideri utilizzare per questo studio. \n4. È sufficiente che sia per lo più su quello schermo. \n5. Poi clicca su PROSEGUI o premi INVIO.",
    ja: "1. このコンピュータには 111 台のカメラが搭載されています。 \n2. この調査では視線または視聴距離を追跡します。そのためには画面の上端にカメラが必要です。そのため、上端カメラを備えた画面を選択してください。 \n3. このウィンドウをこの研究に使用したい画面にドラッグしてください。\n4. ほとんどがその画面上に表示されていれば十分です。\n5. [続行] をクリックするか、Return キーを押します。",
    kn: "Loading...",
