  RC_UseObjectToSetViewingDistance2: {
    "en-US":
      "1. Great! You’ve completed the first of two measurements.\n2. Now lean back to reset your position.\n3. Again lean toward the webcam, until the distance from the webcam to your eye matches the object’s length.\n4. Without moving your head, remove the object, and press RETURN or click PROCEED to continue.",
    ar: "1. رائع! لقد أكملت القياس الأول من اثنين.\n2. الآن اتكئ للخلف لإعادة ضبط وضعك.\n3. مرة أخرى، اتكئ نحو كاميرا الويب حتى تتطابق المسافة من كاميرا الويب إلى عينك مع طول الجسم.\n4. دون تحريك رأسك، أزل الجسم واضغط على RETURN أو انقر على PROCEED للمتابعة.",
    hy: "Loading...",
    bg: "Loading...",
    "zh-CN": "Loading...",
    "zh-HK": "Loading...",
    hr: "1. Sjajno! Završili ste prvo od dva mjerenja.\n2. Sada se naslonite kako biste vratili svoj položaj.\n3. Ponovno se nagnite prema web kameri, sve dok udaljenost web kamere od vašeg oka ne odgovara duljini objekta.\n4. Bez pomicanja glave, uklonite objekt i pritisnite RETURN ili pritisnite PROCEED za nastavak.",
    cs: "Loading...",
    da: "Loading...",
    nl: "Loading...",
    "en-UK":
      "1. Great! You’ve completed the first of two measurements.\n2. Now lean back to reset your position.\n3. Again lean towards the webcam, until the distance from the webcam to your eye matches the object’s length.\n4. Without moving your head, remove the object, and press RETURN or click PROCEED to continue.",
    fi: "1. Hienoa! Olet suorittanut ensimmäisen kahdesta mittauksesta.\n2. Nojaa nyt taaksepäin asennon nollaamiseksi.\n3. Nojaa jälleen verkkokameraa kohti, kunnes verkkokameran ja silmäsi välinen etäisyys vastaa kohteen pituutta.\n4. Siirtämättä päätäsi, poista esine ja paina RETURN tai jatka napsauttamalla PROCEED.",
    fr: "1. Super ! Vous avez terminé la première des deux mesures. 2. Maintenant, penchez-vous en arrière pour réinitialiser votre position. 3. Penchez-vous à nouveau vers la webcam, jusqu'à ce que la distance entre la webcam et votre œil corresponde à la longueur de l'objet. 4. Sans bouger la tête, retirez l'objet et appuyez sur RETOUR ou cliquez sur CONTINUER pour continuer.",
    de: "1. Großartig! Sie haben die erste von zwei Messungen abgeschlossen.\n2. Lehnen Sie sich nun zurück, um Ihre Position neu einzustellen.\n3. Lehnen Sie sich erneut zur Webcam, bis der Abstand von der Webcam zu Ihrem Auge der Länge des Objekts entspricht.\n4. Entfernen Sie das Objekt, ohne Ihren Kopf zu bewegen, und drücken Sie die Eingabetaste oder klicken Sie auf WEITER, um fortzufahren.",
    el: "1. Τέλεια! Ολοκληρώσατε την πρώτη από τις δύο μετρήσεις.\n2. Τώρα γείρετε προς τα πίσω για να επαναφέρετε τη θέση σας.\n3. Γείρε πάλι προς την κάμερα web, έως ότου η απόσταση από την κάμερα web μέχρι το μάτι σας ταιριάζει με το μήκος του αντικειμένου.\n4. Χωρίς να μετακινήσετε το κεφάλι σας, αφαιρέστε το αντικείμενο και πατήστε RETURN ή κάντε κλικ στο PROCEED για να συνεχίσετε.",
    he: "Loading...",
    hi: "Loading...",
    hu: "1. Remek! Elvégezte a két mérés közül az elsőt.\n2. Most dőljön hátra a pozíció visszaállításához.\n3. Hajoljon ismét a webkamera felé, amíg a webkamera és a szem távolsága meg nem egyezik a tárgy hosszával.\n4. Feje mozgatása nélkül távolítsa el az objektumot, és nyomja meg a RETURN gombot, vagy kattintson a Folytatás gombra a folytatáshoz.",
    is: "Loading...",
    id: "Loading...",
    it: "1. Ottimo! Hai completato la prima delle due misurazioni.\n2. Ora appoggiati indietro per ripristinare la tua posizione.\n3. Avvicinati di nuovo alla webcam, finché la distanza dalla webcam al tuo occhio non corrisponde alla lunghezza dell'oggetto.\n4. Senza muovere la testa, rimuovi l'oggetto e premi INVIO o clicca su PROSEGUI per continuare.",
    ja: "Loading...",
    kn: "Loading...",
    ko: "Loading...",
    lt: "Loading...",
    ms: "Loading...",
    ml: "Loading...",
    no: "Loading...",
    fa: "Loading...",
    pl: "1. Świetnie! Ukończyłeś pierwszy z dwóch pomiarów.\n2. Teraz odchyl się do tyłu, aby zresetować swoją pozycję.\n3. Ponownie pochyl się w stronę kamery internetowej, aż odległość kamery od oka będzie równa długości obiektu.\n4. Nie poruszając głową, usuń obiekt i naciśnij POWRÓT lub kliknij PROCEED, aby kontynuować.",
    pt: "Loading...",
    ro: "1. Grozav! Ați finalizat prima dintre cele două măsurători.\n2. Acum aplecați-vă înapoi pentru a vă reseta poziția.\n3. Înclinați-vă din nou spre camera web, până când distanța de la camera web la ochi se potrivește cu lungimea obiectului.\n4. Fără a vă mișca capul, îndepărtați obiectul și apăsați RETURN sau faceți clic pe PROCEED pentru a continua.",
    ru: "Loading...",
    sr: "1. Одлично! Завршили сте прво од два мерења.\n2. Сада се нагните уназад да бисте вратили своју позицију.\n3. Поново се нагните ка веб камери, све док растојање од веб камере до вашег ока не одговара дужини објекта.\n4. Без померања главе, уклоните предмет и притисните РЕТУРН или кликните НАСТАВИ да наставите.",
    es: "1. ¡Genial! Has completado la primera de dos mediciones. 2. Ahora recuéstate para restablecer tu posición. 3. Nuevamente inclínate hacia la cámara web, hasta que la distancia desde la cámara web hasta tu ojo coincida con la longitud del objeto. 4. Sin mover la cabeza, retira el objeto y presiona RETURN o haz clic en PROCEED para continuar.",
    sw: "Loading...",
    sv: "1. Bra! Du har slutfört den första av två mätningar.\n2. Luta dig nu bakåt för att återställa din position.\n3. Luta dig åter mot webbkameran tills avståndet från webbkameran till ditt öga matchar objektets längd.\n4. Ta bort föremålet utan att röra på huvudet och tryck på RETURN eller klicka på FORTSÄTT för att fortsätta.",
    tl: "Loading...",
    tr: "1. Harika! İki ölçümün ilkini tamamladınız.\n2. Şimdi konumunuzu sıfırlamak için arkanıza yaslanın.\n3. Web kamerasından gözünüze olan mesafe nesnenin uzunluğuyla eşleşinceye kadar tekrar web kamerasına doğru eğilin.\n4. Başınızı hareket ettirmeden nesneyi kaldırın ve devam etmek için GERİ DÖN'e basın veya DEVAM ET'e tıklayın.",
    ur: "Loading...",
  },
