    da: "Loading...",
    nl: "Loading...",
    "en-UK":
      "1. Close your RIGHT eye. (This is the right side of the screen.)\n2. Use the arrow key ◀ to slide the flickering dot. While looking at the cross, monitor the flickering dot in the corner of your eye, and slide it left and right until it disappears into your blind spot.\n3. Hit the SPACE bar.\nNOTE: Keep your eye on the cross. The flickering dot won't disappear while your eye follows it.",
    fi: "Loading...",
    fr: "1. Fermez votre œil DROIT. (C'est le côté droit de l'écran.)\n2. Utilisez la touche fléchée ◀ pour faire glisser le point clignotant. Tout en regardant la croix, surveillez le point clignotant du coin de votre œil et faites-le glisser de gauche à droite jusqu'à ce qu'il disparaisse dans votre angle mort.\n3. Appuyez sur la barre d'ESPACE.\nREMARQUE : Gardez votre œil sur la croix. Le point clignotant ne disparaîtra pas tant que votre œil le suit.",
    de: "Loading...",
    el: "Loading...",
    he: "Loading...",
    hi: "Loading...",
    hu: "Loading...",
    is: "Loading...",
    id: "Loading...",
    it: "1. Chiudi l'occhio DESTRO. (Questo è il lato destro dello schermo.) 2. Usa il tasto freccia ◀ per far scorrere il punto lampeggiante. Mentre guardi la croce, monitora il punto lampeggiante con la coda dell'occhio e fallo scorrere a sinistra e a destra finché non scompare nel tuo punto cieco. 3. Premi la barra SPAZIATRICE. NOTA: Tieni l'occhio sulla croce. Il punto lampeggiante non scomparirà mentre il tuo occhio lo segue.",
    ja: "1. 右目を閉じます。 （画面右側です。）\n2. 矢印キー ◀ を使用して、点滅するドットをスライドします。十字架を見ながら、目の隅にある点がちらつくのを観察し、それが死角に消えるまで左右にスライドさせます。\n3. スペースバーを押します。\n注: 十字架から目を離さないでください。点滅するドットは、目で追っている間は消えません。",
    kn: "Loading...",
    ko: "Loading...",
    lt: "Loading...",
    ms: "Loading...",
    ml: "1. നിങ്ങളുടെ വലത് കണ്ണ് അടയ്ക്കുക. (ഇത് സ്ക്രീനിൻ്റെ വലതുഭാഗമാണ്.)\n2. മിന്നുന്ന ഡോട്ട് സ്ലൈഡ് ചെയ്യാൻ അമ്പടയാള കീ ◀ ഉപയോഗിക്കുക. കുരിശിലേക്ക് നോക്കുമ്പോൾ, നിങ്ങളുടെ കണ്ണിൻ്റെ കോണിലുള്ള മിന്നുന്ന ഡോട്ട് നിരീക്ഷിക്കുക, അത് നിങ്ങളുടെ ബ്ലൈൻഡ്‌സ്‌പോട്ടിലേക്ക് അപ്രത്യക്ഷമാകുന്നതുവരെ ഇടത്തോട്ടും വലത്തോട്ടും സ്ലൈഡ് ചെയ്യുക.\n3. SPACE ബാറിൽ അമർത്തുക.\nശ്രദ്ധിക്കുക: കുരിശിൽ നിങ്ങളുടെ കണ്ണ് വയ്ക്കുക. നിങ്ങളുടെ കണ്ണ് അതിനെ പിന്തുടരുമ്പോൾ മിന്നുന്ന ഡോട്ട് അപ്രത്യക്ഷമാകില്ല.",
    no: "1. Lukk HØYRE øye. (Dette er høyre side av skjermen.)\n2. Bruk piltasten ◀ for å skyve den flimrende prikken. Mens du ser på korset, overvåk den flimrende prikken i øyekroken, og skyv den til venstre og høyre til den forsvinner inn i blindsonen.\n3. Trykk på MELLOMROM.\nMERK: Hold øye med korset. Den flimrende prikken forsvinner ikke mens øyet følger den.",
    fa: "Loading...",
    pl: "Loading...",
    pt: "1. Feche o olho DIREITO. (Este é o lado direito da tela.)\n2. Use a tecla de seta ◀ para deslizar o ponto tremeluzente. Enquanto olha para a cruz, monitore o ponto tremeluzente no canto do olho e deslize-o para a esquerda e para a direita até que desapareça no ponto cego.\n3. Clique na barra de ESPAÇO.\nNOTA: Fique de olho na cruz. O ponto tremeluzente não desaparecerá enquanto seu olho o seguir.",
    ro: "Loading...",
    ru: "1. Закройте ПРАВЫЙ глаз. (Это правая часть экрана.)\n2. С помощью клавиши со стрелкой ◀ переместите мерцающую точку. Глядя на крест, следите за мерцающей точкой в ​​уголке глаза и перемещайте ее влево и вправо, пока она не исчезнет в вашей слепой зоне.\n3. Нажмите клавишу ПРОБЕЛ.\nПРИМЕЧАНИЕ. Следите за крестом. Мерцающая точка не исчезнет, ​​пока ваш глаз будет следить за ней.",
    sr: "Loading...",
    es: "1. Cierra tu ojo DERECHO. (Este es el lado derecho de la pantalla.) 2. Usa la tecla de flecha ◀ para deslizar el punto parpadeante. Mientras miras la cruz, observa el punto parpadeante en el rabillo del ojo y deslízalo hacia la izquierda y la derecha hasta que desaparezca en tu punto ciego. 3. Presiona la barra ESPACIADORA. NOTA: Mantén tu ojo en la cruz. El punto parpadeante no desaparecerá mientras tu ojo lo siga.",
    sw: "1. Funga jicho lako la KULIA. (Huu ndio upande wa kulia wa skrini.)\n2. Tumia kitufe cha mshale ◀ kutelezesha kitone kinachoelea. Unapotazama msalaba, fuatilia kitone kinachopepea kwenye kona ya jicho lako, na ukitelezeshe kushoto na kulia hadi kipotee kwenye upofu wako.\n3. Piga upau wa SPACE.\nKUMBUKA: Weka macho yako msalabani. Nukta inayopepea haitatoweka jicho lako likiifuata.",
