    da: "Loading...",
    nl: '1. Gebruik een liniaal of meetlint om de afstand te meten vanaf het midden van uw scherm tot de voorkant van een van uw ogen (beide ogen zijn prima). Als u een bril draagt, negeer deze dan tijdens het meten.\n2. Leun naar voren of naar achteren, of verplaats uw stoel of dit scherm, totdat de afstand 111 AAA is. De benodigde afstand wordt altijd groot weergegeven aan de rechterkant van dit scherm, vanaf elke afstand leesbaar.\n3. ALS HET TE VER IS, OVERSLAAN. Als je niet zo ver weg kunt komen, sla deze dan over door ❌ op het toetsenbord of X op het toetsenbord te typen.\n4. Zodra u op de juiste afstand bent, houdt u uw hoofd stil en legt u de liniaal opzij, zodat de camera uw hele gezicht onbelemmerd kan zien.\n5. Druk of tik op RETURN op uw toetsenbord of toetsenblok op het telefoonscherm om door te gaan. \n6. De onderstaande voortgangsteller schuift naar rechts en de volgende afstand verschijnt. Ga naar stap 1 hierboven. Elke afstand heeft dezelfde instructies, alleen de afstand verandert.\nOPMERKING: Als het toetsenbord van de telefoon niet meer reageert, vernieuw het dan door op de adresbalk van de telefoon te tikken en vervolgens op "go" te tikken.',
    "en-UK":
      "1. Use a ruler or tape measure to measure the distance from the centre of your screen to the front of one of your eyes (either eye is fine). If you wear glasses, ignore them while measuring.\n2. Lean forward or back, or move your chair or this screen, until the distance is 111 AAA. The required distance is always shown big on the right side of this screen, readable from any distance.\n2'. IS THAT TOO FAR? SKIP IT! If you can't get that far away, then skip this one by typing ❌ on the keypad or X on the keyboard.\n3. Once you’re at the correct distance, keep your head steady and set the ruler aside to ensure the camera has an unobstructed view of your entire face.\n4. Press or tap RETURN on your keyboard or phone-screen keypad to continue.\n5. The progress counter below will slide right, and the next distance will appear. Go to step 1, above. Every distance has the same instructions, only the distance changes.\nNOTE: If the phone keypad ever becomes unresponsive, refresh it by tapping the phone's address bar and tapping \"go\".",
    fi: "Loading...",
    fr: "1. Utilisez une règle ou un mètre ruban pour mesurer la distance entre le centre de votre écran et l'un de vos yeux (n'importe quel œil convient). Si vous portez des lunettes, ignorez-les pendant la mesure. \n2. Penchez-vous en avant ou en arrière, ou déplacez votre chaise ou cet écran, jusqu'à ce que la distance soit de 111 AAA. La distance requise est toujours affichée en grand sur le côté droit de cet écran, lisible de n'importe quelle distance. \n3. SI C'EST TROP LOIN, PASSEZ. Si vous ne pouvez pas vous éloigner autant, passez celui-ci en tapant ❌ sur le pavé numérique ou X sur le clavier. \n4. Une fois à la bonne distance, gardez la tête immobile et mettez la règle de côté pour vous assurer que la caméra a une vue dégagée de l'ensemble de votre visage. \n5. Appuyez sur RETOUR sur votre clavier ou le pavé numérique de l'écran de votre téléphone pour continuer. \n6. Le compteur de progression ci-dessous glissera vers la droite, et la distance suivante apparaîtra. Passez à l'étape 1, ci-dessus. Chaque distance a les mêmes instructions, seule la distance change. \nREMARQUE : Si le pavé numérique du téléphone devient insensible, actualisez-le en tapant sur la barre d'adresse du téléphone et en appuyant sur \"go\".",
    de: "Loading...",
    el: "Loading...",
    he: "Loading...",
    hi: "Loading...",
    hu: "1. Használjon vonalzót vagy mérőszalagot a képernyő közepe és az egyik szeme eleje közötti távolság megméréséhez (mindegyik szem jó). Ha szemüveget visel, ne vegye figyelembe a mérés során.\n2. Hajoljon előre vagy hátra, vagy mozgassa a széket vagy ezt a képernyőt, amíg a távolság el nem éri a 111 AAA-t. A szükséges távolság mindig nagy méretben jelenik meg a képernyő jobb oldalán, bármilyen távolságból leolvasható.\n3. HA TÚL TOVÁBB VAN, HAGYJA KI. Ha nem tud olyan messzire eljutni, hagyja ki ezt a ❌ billentyűk beírásával vagy az X betűvel a billentyűzeten.\n4. Ha megfelelő távolságra van, tartsa stabilan a fejét, és tegye félre a vonalzót, hogy a kamera akadálytalanul lássa az egész arcát.\n5. Nyomja meg vagy érintse meg a VISSZA gombot a billentyűzeten vagy a telefon képernyőjének billentyűzetén a folytatáshoz. \n6. Az alábbi folyamatszámláló jobbra csúszik, és megjelenik a következő távolság. Folytassa a fenti 1. lépéssel. Minden távolságnak ugyanazok az utasításai, csak a távolság változik.\nMEGJEGYZÉS: Ha a telefon billentyűzete nem reagál, frissítse a telefon címsorának megérintésével, majd a „go” gomb megérintésével.",
    is: "Loading...",
    id: "Loading...",
    it: '1. Usa un righello o un metro a nastro per misurare la distanza dal centro dello schermo alla parte anteriore di uno dei tuoi occhi (va bene qualsiasi occhio). Se indossi occhiali, ignorali durante la misurazione. \n2. Sporgiti in avanti o indietro, o sposta la sedia o questo schermo, fino a quando la distanza è 111 AAA. La distanza richiesta è sempre mostrata in grande sul lato destro di questo schermo, leggibile da qualsiasi distanza. \n3. SE È TROPPO LONTANO, SALTALO. Se non riesci ad allontanarti così tanto, salta questo passaggio digitando ❌ sul tastierino o X sulla tastiera. \n4. Una volta che sei alla distanza corretta, mantieni la testa ferma e metti da parte il righello per garantire che la fotocamera abbia una vista libera di tutto il tuo viso. \n5. Premi o tocca INVIO sulla tastiera o sul tastierino dello schermo del telefono per continuare. \n6. Il contatore di avanzamento sotto scorrerà a destra e apparirà la distanza successiva. Vai al passaggio 1, sopra. Ogni distanza ha le stesse istruzioni, solo la distanza cambia. \nNOTA: Se il tastierino del telefono diventa mai non reattivo, rinfrescalo toccando la barra degli indirizzi del telefono e toccando "vai".',
