    fi: "Loading...",
    fr: "1. Mesurez, en centimètres, la largeur et la hauteur de l'écran lumineux.\n2. Mesurez chaque marge — gauche, droite, haut et bas — du bord de l'écran au bord physique du moniteur.\n3. Mesurez l'élévation de la table jusqu'au bord inférieur du moniteur. C'est le bord inférieur de la marge.",
    de: "Loading...",
    el: "Loading...",
    he: "1. מדוד, בסנטימטרים, את הרוחב והגובה של המסך הזוהר.\n2. מדוד כל שוליים - שמאל, ימין, עליון ותחתון - מקצה המסך ועד לקצה הפיזי של הצג.\n3. מדוד גובה מהשולחן עד לקצה התחתון של הצג. זה הקצה התחתון של השוליים.",
    hi: "Loading...",
    hu: "Loading...",
    is: "Loading...",
    id: "1. Ukur, dalam sentimeter, Lebar dan Tinggi layar bercahaya.\n2. Ukur setiap margin — Kiri, Kanan, Atas, dan Bawah — dari tepi layar hingga tepi fisik monitor.\n3. Ukur ketinggian dari meja hingga tepi bawah monitor. Itu adalah tepi bawah margin.",
    it: "1. Misura, in centimetri, la Larghezza e l'Altezza dello schermo luminoso.\n2. Misura ogni margine — Sinistro, Destro, Superiore e Inferiore — dal bordo dello schermo al bordo fisico del monitor.\n3. Misura l'elevazione dal tavolo fino al bordo inferiore del monitor. Questo è il bordo inferiore del margine.",
    ja: "Loading...",
    kn: "1. ಪ್ರಜ್ವಲಿಸುವ ಪರದೆಯ ಅಗಲ ಮತ್ತು ಎತ್ತರವನ್ನು ಸೆಂಟಿಮೀಟರ್‌ಗಳಲ್ಲಿ ಅಳೆಯಿರಿ.\n2. ಪರದೆಯ ಅಂಚಿನಿಂದ ಮಾನಿಟರ್‌ನ ಭೌತಿಕ ಅಂಚಿನವರೆಗೆ - ಎಡ, ಬಲ, ಮೇಲ್ಭಾಗ ಮತ್ತು ಕೆಳಭಾಗದ ಪ್ರತಿ ಅಂಚನ್ನು ಅಳೆಯಿರಿ.\n3. ಟೇಬಲ್‌ನಿಂದ ಮಾನಿಟರ್‌ನ ಕೆಳಗಿನ ಅಂಚಿನವರೆಗೆ ಎತ್ತರವನ್ನು ಅಳೆಯಿರಿ. ಅದು ಅಂಚಿನ ಕೆಳಗಿನ ಅಂಚು.",
    ko: "1. 빛나는 화면의 너비와 높이를 센티미터 단위로 측정합니다.\n2. 화면 가장자리부터 모니터의 실제 가장자리까지 왼쪽, 오른쪽, 위쪽, 아래쪽의 각 여백을 측정합니다.\n3. 테이블에서 모니터 하단 가장자리까지 높이를 측정합니다. 이것이 여백의 아래쪽 가장자리입니다.",
