    fr: "IMPORTANT : Cette page doit afficher un code QR. Si le code QR est manquant, appuyez d'abord sur la touche ÉCHAP pour révéler la barre d'adresse. Ensuite, utilisez l'une de ces méthodes pour actualiser la page :\n• Option 1 : Cliquez sur l'icône de rafraîchissement ⟳ dans la barre d'adresse de votre navigateur.\n• Option 2 : Cliquez à l'intérieur de la barre d'adresse, puis appuyez sur RETOUR ou ENTRÉE sur votre clavier.\n• Option 3 : Ouvrez le menu de votre navigateur (cliquez sur \"…\" ou \"⋮\"), et sélectionnez Actualiser ou Recharger dans le menu.",
