    it: "Questo studio necessita dell'uso della webcam. Concedere l'accesso alla tua webcam è facoltativo, ma non possiamo continuare senza di esso. Se hai detto No per errore e ora desideri concedere l'accesso alla tua fotocamera, puoi farlo. Prima premi il tasto ESC per rivelare la barra degli indirizzi. Poi trova l'icona della fotocamera nella barra degli indirizzi, cliccala, consenti l'accesso alla fotocamera e aggiorna la pagina. Per aggiornare la pagina, tocca l'icona di aggiornamento \"⟳\" nella barra degli indirizzi.",
