    id: "APAKAH TELEPON UJI TERHUBUNG KE INTERNET?\n1. YA, lalu klik OK di bawah untuk melanjutkan.\n2. 📶 LAYANAN SEL: Jika layanan seluler ponsel terhubung ke internet, klik OK.\n3. 🛜 WIFI: Hubungkan ke internet melalui Wi-Fi dan klik OK.\n4. ATUR WAKTU DAN TANGGAL: Ponsel baru, atau ponsel lama yang telah direset, tidak memiliki akun layanan seluler dan tanggal yang salah. Setelah Anda mengatur waktu dan tanggal, ini akan berfungsi dengan hotspot/tethering, seperti yang dijelaskan selanjutnya.\n5. HOTSPOT: Jika telepon uji bukan telepon pribadi Anda, dan telepon pribadi Anda memiliki internet, kedua telepon dapat berbagi akses internet. Hubungkan ponsel satu sama lain melalui Wi-Fi, Bluetooth, atau USB:\n    * 🛜 Hotspot Wi-Fi: Jika ponsel pribadi Anda terhubung ke internet melalui layanan seluler, ponsel tersebut dapat menyediakan hotspot Wi-Fi ke ponsel uji. Setelah terhubung, klik OK.\n    * >ᛒ Penambatan Bluetooth: Jika ponsel pribadi Anda menggunakan Wi-Fi untuk akses internet, ponsel tersebut dapat berbagi akses internet melalui Bluetooth. Aktifkan Bluetooth (di iPhone) atau tethering Bluetooth (di Android) di kedua ponsel, pasangkan melalui Bluetooth, dan klik OK.\n    * Penambatan USB: Jika kedua ponsel adalah iPhone atau kedua ponsel adalah Android, keduanya dapat berbagi akses internet melalui kabel USB, jika Anda memiliki kabel yang tepat. Saat ini, sebagian besar ponsel menggunakan konektor USB-C, tetapi iPhone 14 dan versi lebih lama menggunakan konektor Lightning. Hubungkan telepon melalui kabel yang sesuai dan klik OK.\n\n6. TIDAK ADA INTERNET: Jika tidak satu pun dari opsi ini tersedia, klik OK terlebih dahulu, lalu “Semua upaya koneksi gagal”.",
    it: "IL TELEFONO DI TEST È CONNESSO A INTERNET?\n1. SÌ, quindi fai clic su OK qui sotto per procedere.\n2. 📶 SERVIZIO CELLULARE: Se il servizio cellulare del telefono si connette a Internet, fai clic su OK.\n3. 🛜 WIFI: Connettilo a Internet tramite Wi-Fi e fai clic su OK.\n4. IMPOSTA ORA E DATA: Un telefono nuovo o un telefono vecchio che è stato resettato non ha un account di servizio cellulare e la data errata. Una volta impostati l'ora e la data, funzionerà con hotspot/tethering, come spiegato di seguito.\n5. HOTSPOT: Se il telefono di test non è il tuo telefono personale e il tuo telefono personale ha Internet, i due telefoni possono condividere l'accesso a Internet. Connetti i telefoni tra loro tramite Wi-Fi, Bluetooth o USB:\n    * 🛜 Hotspot Wi-Fi: Se il tuo telefono personale è connesso a Internet tramite servizio cellulare, può fornire un hotspot Wi-Fi al telefono di test. Una volta connesso, fai clic su OK.\n    * >ᛒ Tethering Bluetooth: Se il tuo telefono personale utilizza il Wi-Fi per l'accesso a Internet, può condividere l'accesso a Internet tramite Bluetooth. Abilita il Bluetooth (su iPhone) o il tethering Bluetooth (su Android) su entrambi i telefoni, accoppiali tramite Bluetooth e fai clic su OK.\n    * Tethering USB: Se entrambi i telefoni sono iPhone o entrambi sono Android, possono condividere l'accesso a Internet tramite un cavo USB, se hai il cavo giusto. Oggi, la maggior parte dei telefoni utilizza un connettore USB-C, ma l'iPhone 14 e precedenti utilizzano il connettore Lightning. Connetti i telefoni tramite il cavo appropriato e fai clic su OK.\n\n6. NESSUN INTERNET: Se nessuna di queste opzioni è disponibile, fai prima clic su OK e poi su \"Tutti i tentativi di connessione non riusciti\".",
    ja: "テスト用の電話はインターネットに接続されていますか?\n1. はい、下の [OK] をクリックして続行します。\n2. 📶 携帯電話サービス: 携帯電話の携帯電話サービスがインターネットに接続している場合は、[OK] をクリックします。\n3. 🛜 WIFI: Wi-Fi 経由でインターネットに接続し、[OK] をクリックします。\n4. 時刻と日付の設定: 新しい電話、またはリセットされた古い電話には携帯サービス アカウントがなく、日付が間違っています。時刻と日付を設定すると、次に説明するように、ホットスポット/テザリングで機能します。\n5. ホットスポット: テスト用の電話機が個人用の電話機ではなく、個人用の電話機にインターネットが接続されている場合、2 台の電話機でインターネット アクセスを共有できます。 Wi-Fi、Bluetooth、または USB を使用して電話機を相互に接続します。\n    * 🛜 Wi-Fi ホットスポット: 個人の電話が携帯電話サービス経由でインターネットに接続されている場合、テスト用電話に Wi-Fi ホットスポットを提供できます。接続したら、「OK」をクリックします。\n    * >ᛒ Bluetooth テザリング: 個人の携帯電話がインターネット アクセスに Wi-Fi を使用している場合、Bluetooth 経由でインターネット アクセスを共有できます。両方の携帯電話で Bluetooth (iPhone の場合) または Bluetooth テザリング (Android の場合) を有効にし、Bluetooth 経由でペアリングして、[OK] をクリックします。\n    * USB テザリング: 両方の携帯電話が iPhone または両方の携帯電話が Android の場合、適切なケーブルがあれば、USB ケーブルを介してインターネット アクセスを共有できます。現在、ほとんどの携帯電話は USB-C コネクタを使用していますが、iPhone 14 以前では Lightning コネクタが使用されています。適切なケーブルを介して電話機を接続し、[OK] をクリックします。\n\n6. インターネットなし: これらのオプションがいずれも利用できない場合は、まず [OK] をクリックし、次に [すべての接続試行が失敗しました] をクリックします。",
