      "OTHERWISE: If your camera doesn't recognise the QR code, just copy xxx into your phone browser and tap the browser's GO button. This page should then advance. If not, then LLL, and try again. Failing that, click the ALL CONNECTION ATTEMPTS FAILED button. If you want to participate without connecting your phone, click the PREFER NOT button. Finally, if no smartphone is handy, click NO SMARTPHONE.",
    fi: "Loading...",
    fr: "AUTREMENT :\nSi votre appareil photo ne reconnaît pas le code QR, copiez simplement xxx dans le navigateur de votre téléphone et appuyez sur le bouton ALLER du navigateur. Cette page devrait alors avancer. Sinon, alors LLL, et réessayez. En cas d'échec, cliquez sur le bouton TOUTES LES TENTATIVES DE CONNEXION ONT ÉCHOUÉ. Si vous souhaitez participer sans connecter votre téléphone, cliquez sur le bouton PRÉFÈRE NE PAS. Enfin, si aucun smartphone n'est disponible, cliquez sur PAS DE SMARTPHONE.",
