    el: "Loading...",
    he: "Loading...",
    hi: "Loading...",
    hu: "Loading...",
    is: "Loading...",
    id: "JIKA TIDAK:\nJika kamera Anda tidak mengenali kode QR, salin saja\nxxx\nke browser ponsel Anda dan ketuk tombol GO di browser. Halaman ini kemudian harus maju.\nJika tidak, maka LL, dan coba lagi.\nJika gagal, klik tombol SEMUA UPAYA KONEKSI GAGAL.\nJika Anda ingin berpartisipasi tanpa menghubungkan ponsel Anda, klik tombol PREFER NOT.\nTerakhir, jika tidak ada ponsel pintar yang bisa digunakan, klik NO SMARTPHONE.",
    it: "ALTRIMENTI: Se la tua fotocamera non riconosce il codice QR, copia semplicemente xxx nel browser del tuo telefono e tocca il pulsante VAI del browser. Questa pagina dovrebbe quindi avanzare. In caso contrario, allora LLL, e riprova. Se anche questo fallisce, fai clic sul pulsante TUTTI I TENTATIVI DI CONNESSIONE FALLITI. Se vuoi partecipare senza collegare il tuo telefono, fai clic sul pulsante PREFERISCO DI NO. Infine, se non hai uno smartphone a portata di mano, fai clic su NESSUNO SMARTPHONE.",
    ja: "Loading...",
    kn: "Loading...",
    ko: "Loading...",
    lt: "Loading...",
    ms: "SELAINNYA:\nJika kamera anda tidak mengenali kod QR, salin sahaja\nxxx\nke dalam penyemak imbas telefon anda dan ketik butang GO penyemak imbas. Halaman ini kemudiannya harus maju.\nJika tidak, maka LLL, dan cuba lagi.\nJika gagal, klik butang SEMUA PERCUBAAN SAMBUNGAN GAGAL.\nJika anda ingin mengambil bahagian tanpa menyambungkan telefon anda, klik butang PREFER NOT.\nAkhir sekali, jika tiada telefon pintar yang berguna, klik NO SMARTPHONE.",
    ml: "അല്ലാത്തപക്ഷം:\nനിങ്ങളുടെ ക്യാമറ QR കോഡ് തിരിച്ചറിയുന്നില്ലെങ്കിൽ, പകർത്തുക\nxxx\nനിങ്ങളുടെ ഫോൺ ബ്രൗസറിൽ കയറി ബ്രൗസറിൻ്റെ GO ബട്ടൺ ടാപ്പ് ചെയ്യുക. തുടർന്ന് ഈ പേജ് മുന്നോട്ട് പോകണം.\nഇല്ലെങ്കിൽ, LLL, വീണ്ടും ശ്രമിക്കുക.\nപരാജയപ്പെട്ടാൽ, എല്ലാ കണക്ഷൻ ശ്രമങ്ങളും പരാജയപ്പെട്ടു എന്ന ബട്ടൺ ക്ലിക്ക് ചെയ്യുക.\nനിങ്ങളുടെ ഫോൺ കണക്‌റ്റ് ചെയ്യാതെ തന്നെ പങ്കെടുക്കാൻ താൽപ്പര്യമുണ്ടെങ്കിൽ, PreFER NOT ബട്ടൺ ക്ലിക്ക് ചെയ്യുക.\nഅവസാനമായി, ഒരു സ്‌മാർട്ട്‌ഫോണും ലഭ്യമല്ലെങ്കിൽ, സ്‌മാർട്ട്‌ഫോൺ വേണ്ട എന്നതിൽ ക്ലിക്ക് ചെയ്യുക.",
    no: "NOE ANNET:\nHvis kameraet ditt ikke gjenkjenner QR-koden, er det bare å kopiere\nxxx\ninn i telefonens nettleser og trykk på nettleserens GO-knapp. Denne siden bør deretter gå videre.\nHvis ikke, så LLL, og prøv igjen.\nHvis ikke, klikker du på ALLE TILKOBLINGSFORSØK MISLYKKES-knappen.\nHvis du ønsker å delta uten å koble til telefonen, klikker du på FORETRUKKE-knappen.\nTil slutt, hvis ingen smarttelefon er tilgjengelig, klikker du på INGEN SMARTPHONE.",
