    pt: "3. MIC. ESTÁ NA BORDA INFERIOR. Quando o telefone está na vertical, o microfone fica na borda inferior.\n4. RETIRE A CAIXA. Exponha o microfone do seu telefone removendo qualquer capa protetora.\n5. DESCANSE O TELEFONE EM UM COPO ALTO (ou caneca de café ou lata de refrigerante/cerveja ou jarro ou caixa ou pilha de livros), entre você e o teclado, com a borda do microfone (inferior) voltada para o computador. \n     Os alto-falantes do laptop estão no teclado; coloque o telefone de forma que o microfone fique na sua linha de visão do teclado. \n     Os alto-falantes de mesa ficam atrás de uma grade; aponte seu telefone para a grade.\n6. Um botão PROCEDER aparecerá abaixo. Clique nele para iniciar a calibração.",
    ro: "Loading...",
    ru: "Loading...",
    sr: "Loading...",
    es: "3. EL MICRÓFONO ESTÁ EN EL BORDE INFERIOR. Cuando tu teléfono está en posición vertical, su micrófono está en el borde inferior. 4. QUITA LA FUNDA. Deja al descubierto el micrófono de tu teléfono quitando cualquier funda protectora. 5. COLOCA EL TELÉFONO SOBRE UN VASO ALTO (o taza de café o lata de refresco/cerveza o frasco o caja o pila de libros), entre tú y tu teclado, con el borde del micrófono (inferior) hacia tu computadora. Los altavoces de la laptop están en el teclado; coloca tu teléfono de manera que su micrófono esté en tu línea de visión hacia el teclado. Los altavoces de escritorio están detrás de una rejilla; apunta tu teléfono hacia la rejilla. 6. Aparecerá un botón de PROCEDER abajo. Haz clic en él para comenzar a calibrar.",
