    es: 'showMeasuredSoundLevelBool es VERDADERO en una o más condiciones, por lo que se necesita un micrófono para hacer esas mediciones.\n1. CONECTE su micrófono miniDSP UMIK-1 o 2 a esta computadora.\n2. SELECCIONE ese micrófono en el menú desplegable de entrada de sonido a continuación.\n3. SELECCIONE el nombre del modelo del micrófono, UMIK-1 o 2.\n4. Ingrese el número de SERIE y haga clic en el botón OBTENER PERFIL.\n5. CONFIGURAR MICRÓFONO\n a. Extienda las tres patas del trípode tanto como sea posible.\n b. El clip del micrófono del trípode está en un pivote. Gire el clip completamente hacia el lado que haga que el borde más alto del clip sea más alto.\n c. Inserte el micrófono en el clip del trípode, desde abajo, hasta que el extremo inferior del micrófono esté al ras con el borde más bajo del clip.\n d. Ajuste la inclinación para que el micrófono esté vertical, apuntando hacia el techo.\n e. Coloque el trípode en la mesa entre usted y su computadora. Gire el trípode para llevar el micrófono a su lado.\n f. Empuje el trípode hacia su computadora (o lo que tenga los altavoces) hasta que las dos patas más alejadas del trípode casi lo toquen, y la tercera pata esté cerca de usted.\n6. PERMITIR USO DEL MICRÓFONO. Si aparece una ventana emergente pidiendo permiso para usar el micrófono, haga clic en "Permitir".\n7. ⇧🔊 VOLUMEN MÁXIMO. Para una medición de sonido precisa, por favor maximice el volumen de sonido de su computadora ahora, y luego no toque el volumen hasta que termine la sesión.\n8. Haga clic en CONTINUAR o presione RETURN.',
