    es: "1. ⇧🔊 VOLUMEN MÁXIMO. Para una calibración de sonido precisa, por favor maximice el volumen de sonido de su computadora ahora, antes de la calibración, y luego no toque el volumen hasta que termine la sesión. 2. SIN AURICULARES. Retire y desconecte cualquier auricular/audífono. Esta calibración no funcionará con auriculares/audífonos.",
    sw: "1. ⇧🔊 MAX VOLUME. Kwa urekebishaji sahihi wa sauti, tafadhali ongeza sauti ya kompyuta yako sasa, kabla ya kurekebisha, kisha usiguse sauti hadi kipindi kiishe.\n2. HAKUNA HEADPHONES. Ondoa na uondoe vipokea sauti vya masikioni/vipokea sauti vya masikioni. Urekebishaji huu hautafanya kazi na vipokea sauti vya masikioni/vipokea sauti vya masikioni.",
