    kn: "Loading...",
    ko: "Loading...",
    lt: "Loading...",
    ms: 'PILIH BAGAIMANA UNTUK MENENTENTUR PEMACARA ANDA:\n1. SUDAH SELESAI. Jika anda sebelum ini telah menentukur pembesar suara komputer ini, anda mungkin mempunyai pilihan untuk melangkau penentukuran semula dengan menggunakan semula profil penentukuran sedia ada anda. Jika tidak, pilih mikrofon untuk ditentukur. Nota: Peraturan keselamatan apl web mengehadkan kebolehcaman komputer, jadi komputer yang sudah ditentukur mungkin tidak dikenali. Jika ini berlaku, cukup ukur semula. Ia mungkin akan diiktiraf lain kali.\n2. TELEFON PINTAR. Gunakan mikrofon terbina dalam telefon pintar anda.\n3. USB. Jika anda memiliki mikrofon miniDSP UMIK-1 atau UMIK-2 (tersedia di Amazon), pilih "USB" dan sambungkan mikrofon anda ke komputer ini.',
