    it: "❌ Mi dispiace, le misurazioni più recenti a sinistra e a destra erano incoerenti. Vuoi riprovare? Tieni un occhio chiuso. Concentrati sulla croce e osserva il punto lampeggiante con la coda dell'occhio. Fai scorrere il punto a sinistra e a destra finché non scompare nel tuo punto cieco, quindi premi la barra SPAZIATRICE. Mantieni la distanza di visione mentre testi entrambi gli occhi.",
    ja: "❌ 申し訳ありませんが、最新の左右の測定値が一致していませんでした。もう一度やり直してください？片目を閉じたままにしてください。十字に焦点を合わせ、目の端に現れる点滅する点を監視してください。死角に消えるまでドットを左右にスライドさせ、スペース バーを押します。両目を検査するときは、観察距離を維持してください。",
    kn: "Loading...",
    ko: "Loading...",
    lt: "Loading...",
    ms: "Loading...",
    ml: "Loading...",
    no: "Loading...",
    fa: "Loading...",
    pl: "❌ Przepraszamy, ostatnie pomiary lewej i prawej strony były niespójne. Spróbuj ponownie? Trzymaj jedno oko zamknięte. Skup się na krzyżyku i obserwuj migającą kropkę kątem oka. Przesuwaj kropkę w lewo i w prawo, aż zniknie w twoim martwym punkcie, a następnie naciśnij klawisz SPACJA. Utrzymuj odległość patrzenia podczas badania obu oczu.",
    pt: "❌ Desculpe, as medições esquerda e direita mais recentes foram inconsistentes. Tentar novamente? Mantenha um olho fechado. Concentre-se na cruz e monitore o ponto piscando no canto do olho. Deslize o ponto para a esquerda e para a direita até que ele desapareça no ponto cego e, em seguida, pressione a barra de ESPAÇO. Mantenha a distância de visualização enquanto testa ambos os olhos.",
    ro: "Loading...",
    ru: "❌ К сожалению, последние измерения слева и справа оказались несовместимыми. Попробуйте еще раз? Держите один глаз закрытым. Сосредоточьтесь на кресте и наблюдайте за мигающей точкой краем глаза. Двигайте точку влево и вправо, пока она не исчезнет в вашей слепой зоне, а затем нажмите ПРОБЕЛ. Сохраняйте расстояние просмотра, проверяя оба глаза.",
    sr: "Loading...",
    es: "❌ Lo siento, las mediciones más recientes de izquierda y derecha fueron inconsistentes. ¿Intentar de nuevo? Mantén un ojo cerrado. Enfócate en la cruz y observa el punto parpadeante con el rabillo del ojo. Desliza el punto hacia la izquierda y la derecha hasta que desaparezca en tu punto ciego, y luego presiona la barra ESPACIADORA. Mantén tu distancia de visión mientras pruebas ambos ojos.",
    sw: "❌ Samahani, vipimo vya hivi majuzi zaidi vya kushoto na kulia havikuwa sawa. Ungependa kujaribu tena? Weka jicho moja limefungwa. Zingatia msalaba na ufuatilie nukta inayong'aa kutoka kwenye kona ya jicho lako. Telezesha kitone kushoto na kulia hadi kipotee kwenye upofu wako, kisha ugonge upau wa SPACE. Dumisha umbali wako wa kutazama unapojaribu macho yote mawili.",
    sv: "❌ Tyvärr, de senaste vänster- och högermåtten var inkonsekventa. Försök igen? Håll ett öga stängt. Fokusera på korset och övervaka den blinkande punkten i ögonvrån. Skjut punkten åt vänster och höger tills den försvinner i din döda vinkel och tryck sedan på MELLANSLAG. Behåll ditt synavstånd när du testar båda ögonen.",
