    hi: "Loading...",
    hu: "Loading...",
    is: "Í hverri tilraun, á meðan þú horfir á krossinn, blikkar tilviljunarkennd LLL í augnkróknum. Bara glampi. Til að læra verkefnið skulum við prófa það fyrst með STATIC skjá. Þegar þú horfir á krossinn, fyrir neðan, án þess að hreyfa augun: Hvaða LLL er það?\n\n             + R  \n\nÞað er R. Þessi skjár er kyrrstæður, svo það væri auðvelt að færa augun að LLL og bera kennsl á það. En, í alvöru prufa, blikkar LLL, svo það er enginn tími til að hreyfa augun. Vinsamlegast skoðaðu krossinn þegar þú byrjar réttarhöldin. Það skiptir ekki máli hvert augu þín fara eftir flassið. Fyrsti prófkubburinn er aðeins nokkrar æfingar, áður en við byrjum af alvöru.",
