    it: "In ogni prova, mentre guardi la croce, un LLL casuale LAMPEGGERÀ nell'angolo del tuo occhio. Solo un lampo. Per imparare il compito, proviamolo prima con un display STATICO. Mentre guardi la croce, sotto, senza muovere gli occhi: Quale LLL è?\n\n             +               R  \n\nÈ una R. Questo display è statico, quindi sarebbe facile muovere gli occhi verso il LLL e identificarlo. Ma, in una prova reale, il LLL LAMPEGGIA, quindi non c'è tempo per muovere gli occhi. Per favore, guarda la croce mentre inizi la prova. Non importa dove vanno i tuoi occhi dopo il lampo. Il primo blocco di test è solo alcune prove di pratica, prima di iniziare sul serio.",
