    es: "En cada ensayo, mientras miras la cruz, un LLL aleatorio DESTELLARÁ en la esquina de tu ojo. Solo un destello. Para aprender la tarea, probémoslo primero con una pantalla ESTÁTICA. Mientras miras la cruz, abajo, sin mover los ojos: ¿Qué LLL es?\n\n             +               R  \n\nEs una R. Esta pantalla es estática, por lo que sería fácil mover los ojos al LLL e identificarlo. Pero, en un ensayo real, el LLL DESTELLA, así que no hay tiempo para mover los ojos. Por favor, mira la cruz al iniciar el ensayo. No importa a dónde vayan tus ojos después del destello. El primer bloque de pruebas es solo unos pocos ensayos de práctica, antes de comenzar en serio.",
