    tr: "Loading...",
    ur: "ہر آزمائش پر، جب آپ صلیب کو دیکھتے ہیں، تو آپ کی آنکھ کے کونے میں ایک بے ترتیب LLL چمکے گا۔ صرف ایک فلیش۔ کام سیکھنے کے لیے، آئیے پہلے اسے ایک STATIC ڈسپلے کے ساتھ آزماتے ہیں۔ کراس کو دیکھتے ہوئے، نیچے، اپنی آنکھوں کو منتقل کیے بغیر: یہ کیا ہے؟\n\n             + آر  \n\nیہ ایک R ہے۔ یہ ڈسپلے جامد ہے، لہذا اپنی آنکھوں کو LLL کی طرف منتقل کرنا اور اس کی شناخت کرنا آسان ہوگا۔ لیکن، ایک حقیقی آزمائش میں، LLL چمکتا ہے، لہذا آپ کی آنکھوں کو منتقل کرنے کا کوئی وقت نہیں ہے. ٹرائل شروع کرتے وقت براہ کرم صلیب کو دیکھیں۔ اس سے کوئی فرق نہیں پڑتا کہ فلیش کے بعد آپ کی آنکھیں کہاں جاتی ہیں۔ ٹیسٹنگ کا پہلا بلاک مشق کی چند آزمائشیں ہیں، اس سے پہلے کہ ہم سنجیدگی سے شروع کریں۔",
