    sr: "Loading...",
    es: "En cada prueba, mientras miras la cruz, una letra aleatoria DESTELLARÁ en la esquina de tu ojo. Solo un destello. Para aprender la tarea, probémoslo primero con una pantalla ESTÁTICA. Mientras miras la cruz, abajo, sin mover los ojos: ¿Qué letra es?\n\n             +               R \n\nEs una R. Esta pantalla es estática, por lo que sería fácil mover los ojos hacia la letra e identificarla. Pero, en una prueba real, la letra DESTELLA, así que no hay tiempo para mover los ojos. Por favor, mira la cruz al iniciar la prueba. No importa a dónde vayan tus ojos después del destello. El primer bloque de pruebas es solo unas pocas pruebas de práctica, antes de comenzar en serio.",
    sw: "Loading...",
    sv: "Loading...",
    tl: "Sa bawat pagsubok, habang tumitingin ka sa krus, isang random na titik ang mag-FLASH sa sulok ng iyong mata. Isang flash lang. Upang matutunan ang gawain, subukan muna natin ito gamit ang isang STATIC na display. Habang nakatingin sa krus, sa ibaba, nang hindi ginagalaw ang iyong mga mata: Anong letra ito?\n\n             +               R  \n\nIto ay isang R. Ang display na ito ay static, kaya magiging madaling ilipat ang iyong mga mata sa titik at tukuyin ito. Ngunit, sa isang tunay na pagsubok, ang sulat ay FLASHED, kaya walang oras upang ilipat ang iyong mga mata. Mangyaring tingnan ang krus habang sinisimulan mo ang paglilitis. Hindi mahalaga kung saan pupunta ang iyong mga mata pagkatapos ng flash. Ang unang bloke ng pagsubok ay ilan lamang sa mga pagsubok ng pagsasanay, bago tayo magsimula nang marubdob.",
