    "zh-CN": "Loading...",
    "zh-HK": "Loading...",
    hr: "Loading...",
    cs: "Při každém pokusu, když se budete dívat na kříž, bude v koutku oka BLIKÁT náhodná číslice. Jen záblesk. Abychom se úkol naučili, zkusme to nejprve se STATICKÝM displejem. Při pohledu na kříž níže, aniž byste pohnuli očima: Jaká je to číslice?\n\n             +               3  \n\nJe to 3. Tento displej je statický, takže by bylo snadné přesunout oči na číslici a identifikovat ji. Ale ve skutečné zkoušce číslice BLIKÁ, takže není čas hýbat očima. Podívejte se prosím na kříž, když zahajujete soud. Nezáleží na tom, kam zamíříte oči po záblesku. Prvním blokem testování je jen několik praktických zkoušek, než začneme naostro.",
