    "en-UK":
      "On each trial, while you look at the cross, a random digit will FLASH in the corner of your eye. Just a flash. To learn the task, let’s try it first with a STATIC display. While looking at the cross, below, without moving your eyes: What digit is it?\n\n             +               3  \n\nIt’s 3. This display is static, so it would be easy to move your eyes to the digit and identify it. But, in a real trial, the digit is FLASHED, so there's no time to move your eyes. Please look at the cross as you initiate the trial. It doesn't matter where your eyes go after the flash. The first block of testing is just a few trials of practice, before we start in earnest.",
    fi: "Loading...",
    fr: "À chaque essai, pendant que vous regardez la croix, un chiffre aléatoire va CLIGNOTER dans le coin de votre œil. Juste un éclair. Pour apprendre la tâche, essayons d'abord avec un affichage STATIQUE. En regardant la croix, ci-dessous, sans bouger les yeux : Quel chiffre est-ce ?\n\n             +               3  \n\nC'est 3. Cet affichage est statique, donc il serait facile de déplacer vos yeux vers le chiffre et de l'identifier. Mais, dans un essai réel, le chiffre CLIGNOTE, donc il n'y a pas de temps pour déplacer vos yeux. Veuillez regarder la croix lorsque vous commencez l'essai. Peu importe où vont vos yeux après le flash. Le premier bloc de test est juste quelques essais de pratique, avant que nous commencions sérieusement.",
    de: "Loading...",
