    es: "En cada prueba, mientras miras la cruz, un dígito aleatorio DESTELLARÁ en la esquina de tu ojo. Solo un destello. Para aprender la tarea, probémoslo primero con una pantalla ESTÁTICA. Mientras miras la cruz, abajo, sin mover los ojos: ¿Qué dígito es?\n\n             +               3  \n\nEs 3. Esta pantalla es estática, por lo que sería fácil mover los ojos al dígito e identificarlo. Pero, en una prueba real, el dígito DESTELLA, así que no hay tiempo para mover los ojos. Por favor, mira la cruz al iniciar la prueba. No importa a dónde vayan tus ojos después del destello. El primer bloque de pruebas es solo unas pocas pruebas de práctica, antes de comenzar en serio.",
